INSERT INTO `ilanlar` VALUES ('3043', 'DÜZ GİRİŞ 3200M2 KİRALIK DEPOLAMA İMALAT İÇİN UYGUN TIR YANAŞIR', '$ 15.000', 'İstanbul', 'Bahçelievler', 'Çobançeşme Mah.', 'Erdal Koruk', '<p style=\"text-align: center;\"><b><font face=\"arial black, sans-serif\" size=\"5\" style=\"background-color: rgb(255, 0, 0);\">AKEL EMLAK&apos;TAN </font></b></p><p>KİRALIK PORTFÖYÜMÜZ TEK KAT ÜZERİNE 3200M2 DİR MÜSTAKİL BİR BİNADIR</p><p>TAVAN YÜKSEKLİĞİ H 2.50</p><p>ELEKTRİK GÜCÜ 300 KW</p><p>ÖZEL GÜVENLİK DUVARI İLE ÇEVRİLİ ÖN BAHÇE 800 M2 TOPLAMDA 4000 M2</p><p>HER İŞE UYGUN POZİSYONDA OLAN BU İŞ YERİMİZ KAPISININ ÖNÜNE TIR YANAŞIR DURUM DADIR</p><p>E 5 VE BASIN EKSPRES YOLUNA ÇOK YAKIN KONUMDADIR </p><p>KİRALAMA ŞARTLARI İKİ KİRA DEPOZİT BİR KİRA PEŞİN VE EMLAK KOMİSYONU VARDIR</p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Portföyümde\nyer alan bu gayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek\nyerinde görmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim\nbilgilerinden tarafıma ulaşabilirsiniz.</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Saygılarımla</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Erdal\nKORUK 0533 453 83 43</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Gayrimenkül\nYatırım Danışmanı</span></b><span style=\"color: black;\"></span></p>', '40.994789825518644,28.824831247329712', 'duz-giris-3200m2-kiralik-depolama-imalat-icin-uygun-tir-yanasir', '1');
INSERT INTO `ilanlar` VALUES ('3044', 'DEPOLAMA İÇİN UYGUN TIR YANAŞIR 3200M2 MÜSTAKİL GİRİŞLİ', '45.000 TL', 'İstanbul', 'Bahçelievler', 'Çobançeşme Mah.', 'Erdal Koruk', '<p style=\"color: rgb(0, 0, 0);text-align: center;\"><b><font face=\"arial black, sans-serif\" size=\"5\" style=\"background-color: rgb(255, 0, 0);\">AKEL EMLAK&apos;TAN </font></b></p><p style=\"color: rgb(0, 0, 0);\">KİRALIK PORTFÖYÜMÜZ TEK KAT ÜZERİNE 3200M2 DİR MÜSTAKİL BİR BİNADIR</p><p style=\"color: rgb(0, 0, 0);\">TAVAN YÜKSEKLİĞİ H 2.70</p><p style=\"color: rgb(0, 0, 0);\">ELEKTRİK GÜCÜ 300 KW</p><p style=\"color: rgb(0, 0, 0);\">ÖZEL GÜVENLİK DUVARI İLE ÇEVRİLİ ÖN BAHÇE 800 M2 TOPLAMDA 4000 M2</p><p style=\"color: rgb(0, 0, 0);\">HER İŞE UYGUN POZİSYONDA OLAN BU İŞ YERİMİZ KAPISININ ÖNÜNE TIR YANAŞIR DURUM DA MÜSTAKİL KULLANIMDADIR</p><p style=\"color: rgb(0, 0, 0);\">E 5 VE BASIN EKSPRES YOLUNA ÇOK YAKIN KONUMDADIR </p><p style=\"color: rgb(0, 0, 0);\">KİRALAMA ŞARTLARI İKİ KİRA DEPOZİT BİR KİRA PEŞİN VE EMLAK KOMİSYONU VARDIR</p><p style=\"color: rgb(0, 0, 0);text-align: justify;\"><b><span style=\"color: black;\">Portföyümde yer alan bu gayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek yerinde görmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim bilgilerinden tarafıma ulaşabilirsiniz.</span></b><span style=\"color: black;\"></span></p><p style=\"color: rgb(0, 0, 0);text-align: justify;\"><b><span style=\"color: black;\">Saygılarımla</span></b><span style=\"color: black;\"></span></p><p style=\"color: rgb(0, 0, 0);text-align: justify;\"><b><span style=\"color: black;\">Erdal KORUK 0533 453 83 43</span></b><span style=\"color: black;\"></span></p><p style=\"color: rgb(0, 0, 0);text-align: justify;\"><b><span style=\"color: black;\">Gayrimenkül Yatırım Danışmanı</span></b></p>', '40.99488978260475,28.825507164001465', 'depolama-icin-uygun-tir-yanasir-3200m2-mustakil-girisli', '1');
