INSERT INTO `ilanlar` VALUES ('3049', 'ESTON KİRAZLI EVLERİNDE 4+1 İÇİ YENİ YAPILMIŞ SATILIK', '515.000 TL', 'İstanbul', 'Bağcılar', 'Yenimahalle Mah.', 'Erdal Koruk', '<div><div><div><div><div><div><p><b>DAİREMİZİN İÇİ YENİ YAPILMIŞTIR ÇELİK KAPI DAHİL AKLINIZA GELECEK NE VARSA YENİLENMİŞTİR HİÇ BİR MASRAFI YOKTUR </b></p><p><b>24.000M2 ALAN ÜZERİNE KURULMUŞ GENİŞ PEYSAJA SAHİPTİR </b></p><p><b>METRO YÜRÜME MESAFESİNDEDİR</b></p><p><b>7/24 GÜVENLİK KAPALI AÇIK OTOPARK </b></p><p><b>KAMERALI GÜVENLİK DENETİM SİSTEMİ</b></p><p><b>ÇOCUK OYUN ALANLARI</b></p><p><b>BASKETBOL VELEYBOL VE FUTBOL SAHASI</b></p><p><b>KAMELYALAR VE DİNLENME ALANLARI</b></p><p><b>MİNİ MARKET</b></p><p><b>TÜM ODALARI AYDINLIK GÜNEŞ ALMAKTADIR VE GÜNEY CEPHEDİR </b></p><p><b>ESTON KİRAZLI EVLERİNDEKİ EN BÜYÜK METRAJA SAHİPTİR</b></p><p><b>BLOKTA ÇİFT ASANSÖR VARDIR</b></p><p><b>YATAK ODASINDA EBEVEYN BANYOSU MEVCUTTUR</b></p><p><b>DAİREMİZ ISI PAY ÖLÇER SİSTEMLİDİR</b></p><p><b>JENARATÖR SUDEPOSU</b></p><p style=\"text-align: justify;\"><span style=\"background-color: rgb(255, 0, 0);\"><b><span style=\"color: black;\">Portföyümde\nyer alan bu gayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek\nyerinde görmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim\nbilgilerinden tarafıma ulaşabilirsiniz.</span></b><span style=\"color: black;\"></span></span></p><p style=\"text-align: justify;\"><span style=\"background-color: rgb(255, 0, 0);\"><b><span style=\"color: black;\">Saygılarımla</span></b><span style=\"color: black;\"></span></span></p><p style=\"text-align: justify;\"><span style=\"background-color: rgb(255, 0, 0);\"><b><span style=\"color: black;\">Erdal\nKORUK 0539 565 23 26</span></b><span style=\"color: black;\"></span></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;background-color: rgb(255, 0, 0);\">Gayrimenkül\nYatırım Danışmanı</span></b><span style=\"color: black;\"></span></p>', '41.04125478325526,28.83440136909485', 'esto