INSERT INTO `ilanlar` VALUES ('3052', 'UYGUN FİYATA DEVREN CEP TELEFONU VE AKSESUAR DÜKKANI', '60.000 TL', 'İstanbul', 'Güngören', 'Mareşal Çakmak Mah.', 'Erdal Koruk', '<p>BU İŞLETME İŞ DEĞİŞİKLİĞİ NEDENİYLE DEVİR OLACAKTIR İŞYERİNİN SAHİBİ AYNI ZAMANDA MÜLK SAHİBİDİR DÜKKAN MÜLKÜ İLE BİRLİKTEDE AYRI AYRIDA VERİLE BİLİR DETAYLAR İÇİN ARAYINIZ </p><p>DEVİR ÜCRETİ 60.000TL</p><p>MÜLKÜ İLE DEVİR FİYATI 200.000TL</p><p>SADECE MÜLKİYET DEVRİ 170.000TL DİR</p><p>DÜKKAN 17M2</p><p style=\"text-align: center;\"><strong><span style=\"color: black;\">AKEL EMLAK KURUMSAL BİR FİRMADIR VE MEVCUT PORTFÖYLERİNİ YER\nGÖSTERME FORMU İMZALATILARAK GEZDİRMEYİ TAAHHÜT EDER.GÖSTERİLEN YER İÇİN DEVİR\nALACAK ŞAHSIN KİMLİK FOTOKOPİSİ İLE ŞİRKET OLARAK GELEN MÜŞTERİLERİN FİRMADA\nYETKİLİ OLDUĞUNA İLİŞKİN FİRMA YETKİ BELGESİ VE FİRMA KAŞESİNİ BERABERİNDE\nGETİRMELERİ GEREKMEKTEDİR.BU KONUDAKİ HASSASİYETİMİZİ SİZ SAYIN\nMÜŞTERİLERİMİZİN ANLAYIŞLA KARŞILAYACAĞINIZI UMARAK HİZMET VEREBİLECEĞİMİZİ\nBELİRTİR,İŞLERİNİZDE BAŞARILAR DİLERİZ.</span></strong><span style=\"color: black;\"></span></p><p><strong><span style=\"color: black;\">ERDAL KORUK 0539 565 23 26</span></strong><span style=\"color: black;\"></span></p><p><br /></p>', '41.01615467289626,28.86385202407837', 'uygun-fiyata-devren-cep-telefonu-ve-aksesuar-dukkani', '1');
INSERT INTO `ilanlar` VALUES ('3053', 'MAHMUTBEY METRO İSTASYONUNA KOMŞU SİTE İÇİ SATILIK 2+1', '390.000 TL', 'İstanbul', 'Bağcılar', 'Mahmutbey Mah.', 'Erdal Koruk', '<p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" color=\"#ff0000\" size=\"5\">AKEL EMLAK&apos;TAN</font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" color=\"#ff0000\" size=\"5\">DEFNE PARK MAHMUTBEY PROJESİNDE SATILIK</font></p><p style=\"color: rgb(0, 0, 0);\">DEFNE PARK PROJEMİZ 33 DAİRE VE 2 ADET DÜKKANDAN 1000M2 İNŞAAT ALANINA SAHİPTİR</p><p style=\"color: rgb(0, 0, 0);\">FARKLI CEPHE VE KATLARDA 3+1 VE 2+1 DAİRELERİMİZ MEVCUTTUR</p><p style=\"color: rgb(0, 0, 0);\">PROJEDE HER DAİREYE AİT KAPALI OTOPARK ÇOCUK OYUN ALANI KAMELYA </p><p style=\"color: rgb(0, 0, 0);\">7/24 KAMERALI GÜVENLİK</p><p style=\"color: rgb(0, 0, 0);\">HER DAİREDE EBEVEYN BANYOSU</p><p style=\"color: rgb(0, 0, 0);\">MUTFAK FULL ANKASTRE</p><p style=\"color: rgb(0, 0, 0);\">HİLTON BANYO</p><p style=\"color: rgb(0, 0, 0);\">DAİRE İÇİ GÖRÜNTÜLÜ DİAFON SİSTEMİ</p><p style=\"color: rgb(0, 0, 0);\">ASMA TAVAN SPOT LED AYDINLATMA VE GİZLİ IŞIK SİSTEMİ</p><p style=\"color: rgb(0, 0, 0);\">GİRİŞTE PORT MANTO</p><p style=\"color: rgb(0, 0, 0);\">YÜKSEK İNŞAAT KALİTESİ</p><p style=\"color: rgb(0, 0, 0);\">ESTETİK GÖRÜNTÜYE ÖZEN GÖSTEREN MİMARİ</p><p style=\"color: rgb(0, 0, 0);\">İKİ ADET BALKON</p><p style=\"color: rgb(0, 0, 0);\">DEFNE PARK PROJEMİZ KONUMU İLE TUM TOPLU TASIMA ARAÇLARININ GÜZERGAHI ÜZERİNDE YER ALMATADIR</p><p style=\"color: rgb(0, 0, 0);\">MAHMUTBEY METRO İSTASYONUNA 300MT MESAFEDE</p><p style=\"color: rgb(0, 0, 0);\">TEM OTOYOLUNA 1,5 KM MESAFEDE</p><p style=\"color: rgb(0, 0, 0);\">BASIN EKSPRESS YOLU 2KM MESAFEDE</p><p style=\"color: rgb(0, 0, 0);\">DETAYLAR İÇİN ARAYINIZ </p><p style=\"color: rgb(0, 0, 0);\">ERDAL KORUK 0533 453 83 43</p>', '41.05154989186385,28.82808208465576', 'mahmutbey-metro-istasyonuna-komsu-site-ici-satilik-2-1', '1');
INSERT INTO `ilanlar` VALUES ('3054', 'KİPTAŞ VADİTEPEDE ÖN PEYZAJ ve CADDE MANZARALI 164 M2 3+1 DAİRE', '620.000 TL', 'İstanbul', 'Başakşehir', 'Bahçeşehir 1. Kısım Mah.', 'Aynur Küçükel', '<p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" size=\"5\">KİPTAŞ VADİTEPE DE 3 ETAPTA B3 BLOK BATI CEPHELİ</font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" size=\"6\">3+1</font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" size=\"5\">164 m2 <u> DAİREMİZ SATILIKTIR.</u></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\" color=\"#ff0000\"><u>FOTOĞRAFLAR DAİREMİZDEN ÇEKİLMİŞ GERÇEK GÖRSELLERDİR.</u></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" size=\"5\" color=\"#ff0000\">FARKLI SEÇENEKLER İÇİN ARAYINIZ...</font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"arial black, sans-serif\">Bahçeşehir’in en değerli ve en büyük arazisi üzerinde hayata geçireceğimiz Vaditepe Bahçeşehir ile özlediğimiz mahalle kültürünü, modern yaşamın kent olgusu içinde kendine has üslubuyla yeniden yorumluyoruz. Siz değerli hemşehrilerimize, şehrin içinde doğayla iç içe yeni ama geçmişin izlerini taşıyan yeni bir yaşam sunuyoruz. 284 dönümlük bir alana sahip olan projemizde, yeşil alanlar ile spor ve yaşam alanlarına yer verdik. Projenin tam önünde yer alan ve projeye adını veren Bahçeşehir Vadisi, 2 milyon metrekareye yakın yeşil alanıyla Vaditepe’yi çok daha özel kılıyor…<span> </span><br /></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"arial black, sans-serif\"> 25.000 metrekarelik ticari alanların yer aldığı Vaditepe Bahçeşehir’de, birbirinden şık mağazalar, kafeler, restoranlar her gününüze ayrı bir keyif katmak için yeni evinizde sizi bekliyor.<span> </span><br /></font></p><p style=\"color: rgb(0, 0, 0);\"><font face=\"arial black, sans-serif\"> Aile Sağlığı Merkezi, ilkokul, ortaokul, sağlık ocağı... Hepsi Vaditepe’nin içinde!<span> </span><br /></font></p><div style=\"text-align: center;color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);\"><span><b><font size=\"4\" face=\"arial black, sans-serif\">* KAPALI YÜZME HAVUZU</font></b></span>', '41.09130526027739,28.676977157592773', 'kiptas-vaditepede-on-peyzaj-ve-cadde-manzarali-164-m2-3-1-daire', '1');
