INSERT INTO `ilanlar` VALUES ('3060', 'SİTE İÇİNDE SATILIK 2+1 GÜVENLİKLİ AÇIK HAVUZLU OTOPARKLI', '365.000 TL', 'İstanbul', 'Bağcılar', 'Kemalpaşa Mah.', 'Erdal Koruk', '<p style=\"text-align: center;\"><font color=\"#ff0000\" size=\"6\"><b>Akel emlak’tan harmonypark&apos;ta kaçmaz fırsat !!!</b></font></p><p><b><font face=\"arial black, sans-serif\">Sitemiz, bağcılar meydana, bağcılar tramvay\nhattına, bağcılar metro hattına 4 dk. Mesafededir.</font></b></p><p><span><b><font face=\"arial black, sans-serif\">Medipol hastanesine 3 dk. </font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">İstoç merkeze 5 dk. </font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Mahmutbey metrosuna 5 dk.</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Tem otoyoluna 1 dk.</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Otogara 10 dk.</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Bağcılar devlet hastanesine 7 dk.</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Havalimanına 20 dk.</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Mesafede merkezi bir konumdadır. Sitemiz toplam\n7370 m2 inşaat  alanına sahip, 4 bloktan oluşmaktadır.  Modern\nyaşamın tüm ihtiyaçlarını göz önüne alındığı projede ortak kullanıma açık\nalanlar</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Sosyal tesisler, açık  yüzme havuzu, sauna\nve fitness center</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Açık spor alanları, voleybol, basketbol, tenis\nsahaları, 24 saat güvenlik</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Ev sahiplerine keyifli ve pratik bir yaşam\nsunma amacıyla düşünülmüş ayrıca çocuklar için oyun alanları, </font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">hem büyüklerin hemde küçüklerin çeşitli\naktivitelerde bulunabilecekleri rekreasyon alanları</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Sığınak ve bisiklet odaları</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Sağlıklı bir gelecek için her ayrıntıyı sizin\nyerinize düşünüyor</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Dijital adresli yangın algılama ve ihbar\nsistemi</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Bina ve daire içleri, gaz ve yangın\ndedektörleri </font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Dijital tabanlı intercom ve fiber internet\nsistemi</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Çöp toplama odaları</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Her blokta 2 adet asansör</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Yangın merdivenleri</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Jeneratör</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Kameralı görüntülü dia fon sistemi\nbulunmaktadır</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">4055 m2 yeşil alana sahip olan  projede\nkeyifli ve huzurlu bir yaşam sunulmaktadır. proje içerisinde 2+1, 3+1\n daire seçenekleriyle farklı katlarda farklı yaşam tarzlarına sesleniyor.</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Bina deprem yönetmeliğine uygun olarak\nyapılmıştır ve radyan temel perde betonludur</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Binanın dış cephesi mantolama olup ısı ve ses\nyalıtımı sağlanmıştır. </font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Bina modern mimariye sahip olup Fransız\nbalkonludur.</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Dairenin salonunda balkon</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Yatak odasında ebeveyn banyosu</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Antrede ise vestiyeri bulunmaktadır </font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Daire ısıtma sistemi merkezi sistem pay ölçerli\n</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">PVC ısıcamlı</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Saten boyalı</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Kartonpiyerli</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Salon ve odalar laminant parkeli</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Çelik kapılı, iç kapılar özel lake panel kapılı</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">laminant mutfaklı</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Hilton banyolu, duşakabinli</font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Kullanışlı lüx bir dairedir </font></b></span></p><p><span><b><font face=\"arial black, sans-serif\">Farklı cephe ve katlarda 2+1 3+1 dairelerimiz\nvardır </font></b></span></p><p><span style=\"color: red;\"><b><font face=\"arial black, sans-serif\">Erdal koruk </font></b></span></p><p><span style=\"color: red;\"><b><font face=\"arial black, sans-serif\">Gayrimenkul yatırım danışmanı </font></b></span></p><p><span style=\"color: red;\"><b><font face=\"arial black, sans-serif\">0533 453 83 43</font></b></span></p>', '41.05266995511404,28.855226039886475', 'site-icinde-satilik-2-1-guvenlikli-acik-havuzlu-otoparkli', '1');
