INSERT INTO `ilanlar` VALUES ('3065', 'POLAT PORT residence 2+1 full ankastreli LÜKS daire', '1.650 TL', 'İstanbul', 'Bağcılar', 'Mahmutbey Mah.', 'Aynur Küçükel', '<p><span style=\"color:#FF0000;\"><strong>İKİTELLİ ORGANİZE ye ve İSTOÇ a hakim bir konumda,OTOBANA çıkışına yakın,KEMERBURGAZ Üniversitesine komşu PRESTİJLİ VE OTURUMA HAZIRDIR.</strong></span></p><p><span style=\"color:#FF0000;\"><strong>EBEVEYN BANYOSU,MUTFAK ankastreleri (buzdolabı dahil) mevcuttur.çelik kasalı ve çift asansörlüdür.</strong></span></p><p><strong><span style=\"background-color:rgb(255,255,255);color:rgb(51,51,51);font-family:helvetica;font-size:15px;\">Polat Port Residence İstanbul Bağcılar&apos;a bağlı Mahmutbey Hacıbostan Mahallesi&apos;nde yükseliyor. Polat İnşaat tarafından inşa edilen Polat Port Residence&apos;ta 82 daire yer alıyor</span></strong></p><p><strong>Polat Port Residence&apos;in kapısından içeri adım attığınızda huzurlu, güvenli ve konforlu bir yaşama da merhaba diyeceksiniz. İş yeri stresi, işin yoruculuğu, trafiğin sıkıntısı, gürültü, kalabalık gibi sizi yoran ne varsa kapıdan içeri girdiğinizde hepsi dışarıda kalacak. Şehrin ortasında ama bir o kadar uzakta hissi veren yeni yaşam alanınızda her anınız eğlenceli, keyifli, güvenli ve doğayla iç içe geçecek.</strong></p><p><strong>Zamanın her anını dolu dolu yaşayın...<br /><br />Polat Port Residence özel mimarisiyle ve her detayı düşünülerek planlanmış daireleriyle sizlere yeni bir yaşam şekli sunuyor. İçeriye adım attığınız andan itibaren yaşadığınız her anın keyfini sürebilceğiniz zengin sosyal alanlarıyla sizlere zamanı dolu dolu yaşatıyor. Son sistem teknoloji aletleriyle donatılmış, sağlıklı ve formda kalmanızı sağlayan Fitness Center... Dört mevsim yüzebilceğiniz Açık ve Kapalı Yüzme Havuzu... Aile fertleriyle veya sevdiklerinizle birlikte yapacağınız heyecanlı maçlar için Tenis Kortu... Gün boyu zinde kalmak için ihtiyacınız olan arınma ve rahatlama için Sauna... Bol skorlu maçlar oynamak için özel Basket Sahası... Günün yorğunluğunu üzerinizden atmanızı sağlayan Hamamı...</strong></p><p> </p><p><strong>AKEL EMLAK </strong></p><p><strong>Aynur Küçükel</strong></p><p><strong>0532 413 28 71</strong></p><p> </p>', '41.0577380662,28.8193809986', 'polat-port-residence-2-1-full-ankastreli-luks-daire', '1');
