/span></p><p><b><span style=\"color: black;\"></span></b></p><p><b><span style=\"color: black;\"></span></b></p><p style=\"text-align: center;\"><b><span style=\"color: black;\">BAĞCILAR BELEDİYE BİNASININ HEMEN\nKARŞISINDA OLUP MAHMUTBEY CADDESİNE CEPHE,TOPLU TAŞIMA ARAÇLARINA ÇOK YAKIN\nMESAFEDEDİR.</span><span style=\"color: black;\"></span></b></p><p style=\"text-align: center;\"><span style=\"color: black;\"><b>HAVAALANINA 10 DK MESAFEDE ,KAMU\nKURUMLARINA İSE 5 DK YÜRÜME MESAFESİNDEDİR.</b></span></p><p style=\"text-align: center;\"><b><span style=\"color: black;\"></span></b></p><p style=\"text-align: center;\"><b><span style=\"color: black;\">GÜNEŞLİ MEYDANA YÜRÜME MESAFESİNDE\nOLUP,1700 M2 ARSA ÜZERİNE İNŞAA EDİLMİŞTİR.</span><span style=\"color: black;\"></span></b></p><p style=\"text-align: center;\"><span style=\"color: black;\"><b>7/24 GÜVENLİK ve KAMERA SİSTEMİ\nMEVCUTTUR</b></span></p><p style=\"text-align: justify;\"><b style=\"background-color: rgb(255, 0, 0);\"><span style=\"color: black;\">Portföyümde\nyer alan bu gayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek\nyerinde görmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim\nbilgilerinden tarafıma ulaşabilirsiniz.</span><span style=\"color: black;\"></span></b></p><p style=\"text-align: justify;\"><b style=\"background-color: rgb(255, 0, 0);\"><span style=\"color: black;\">Saygılarımla</span><span style=\"color: black;\"></span></b></p><p style=\"text-align: justify;\"><b style=\"background-color: rgb(255, 0, 0);\"><span style=\"color: black;\">Erdal\nKORUK 0539 565 23 26</span><span style=\"color: black;\"></span></b></p><p style=\"text-align: justify;\"><b><span style=\"color: black;background-color: rgb(255, 0, 0);\">Gayrimenkül\nYatırım Danışmanı</span></b><span style=\"color: black;\"></span></p>', '41.03603341110186,28.834540843963623', 'nature-park-konaklari-gunesli-039-de-3-1-akel-emlak-039-tan-satilik', '1');
INSERT INTO `ilanlar` VALUES ('3070', '++++++AKEL den ÇINAR OLİMPİA park ta satılık 4+1 daire', '635.000 TL', 'İstanbul', 'Bağcılar', 'Fevziçakmak Mah.', 'Aynur Küçükel', '<p style=\"text-align:center;\"><strong><span style=\"color:rgb(255,0,0);\"><span style=\"font-family:&quot;comic sans ms&quot;, cursive;\"><span style=\"font-size:18px;\">AKEL EMLAK tan SATILIK HAVUZ CEPHELİ</span></span></span></strong></p><p style=\"text-align:center;\"><strong><span style=\"color:rgb(255,0,0);\"><span style=\"font-family:&quot;comic sans ms&quot;, cursive;\"><span style=\"font-size:18px;\">ARA KAT 4+1 SATILIK</span></span></span></strong></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>BAĞCILAR İlçesinin merkezinde bulunan ÇINAR olimpia park sitesi</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>Metar grup güvencesi ile imal edilmiş,mimarisi ile de göz dolduran prestijli bir projedir.</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>Ulaşım kolaylığı ile de tercih edilen ve bilinen tek ve komple bir projesidir.</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>Dairenin tanıtımı : </strong></span></p><p style=\"text-align:center;\"><span style=\"color:rgb(255,0,0);\"><span style=\"font-size:16px;\"><strong>* 4+1 </strong></span></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*Güney cepheli</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>* Yatak odası bölümünde dolaplı mahal </strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*Detaylı bilgiler kısmındaki iç ve dış özelliklerin tümü eksiksiz mevcuttur.</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*Mutfakta tüm ankastre ürünler dahildir.</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*Mutfakta kiler odası mevcuttur.</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*Kiler odası dolaplıdır.</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*Isı izolasyonu teknik şartnameye uygun yapıldığı için kış mevsiminde ısı kaybı minimalize edilmiştir.</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*Sosyal tesisleri hijyenik olup,sadece bayanlar için ayrılmış günleri vardır.Açık havuzu olimpiktir.</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*Otopark sıkıntısı yoktur,asansörle garaj katına ulaşım vardır.</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*Ayrıca yük asansörü olup,haricinde 2 asansör daha mevcuttur.</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*Müstakil jeneratör elektirik kesintilerinde otomatik devreye girmektedir.</strong></span></p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*ÖZENLİ bir site yönetimine ve titiz bir güvenliğe sahiptir.</strong></span></p><p style=\"text-align:center;\"> </p><p style=\"text-align:center;\"> </p><p style=\"text-align:center;\"><span style=\"font-size:16px;\"><strong>*Detaylı bilgi ve dairemizi görmek için <span style=\"color:rgb(255,0,0);\"><span style=\"font-family:&quot;comic sans ms&quot;, cursive;\">AKEL EMLAK </span> Aynur Küçükel</span></strong></span></p><p style=\"text-align:center;\"><span style=\"color:rgb(255,0,0);\"><span style=\"font-size:16px;\"><strong>                                                                            0532 413 28 71</strong></span></span></p>', '41.0430448799,28.8540029526', 'akel-den-cinar-olimpia-park-ta-satilik-4-1-daire', '1');
INSERT INTO `ilanlar` VALUES ('3071', 'GÜNEŞLİ BAĞLAR MH.CADDE ÜSTÜ GENİŞ CEPHELİ DÜKKAN', '580.000 TL', 'İstanbul', 'Bağcılar', 'Güneşli Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\"><span style=\"background-color: rgb(255, 240, 245);\"><font color=\"#ff0000\">AKEL</font> </span>EMLAK TAN</font></p><p style=\"text-align: center;\"><span>GÜNEŞLİ BAĞLAR MAHALLESİNDE CADDE ÜZERİ</span></p><p></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">SIFIR DÜKKAN MAĞAZA SATILIKTIR.</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">HER İŞE UYGUN DEPOLU DÜKKAN İSKANLIDIR.</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">CADDE ÜSTÜ GENİŞ CEPHELİ OTOMATİK KEPENKLİ YÜKSEK TAVANLI</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">KOMBİLİ </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">0532 413 28 71</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">Aynur Küçükel</font></p><p style=\"text-align: center;\"><br /></p>', '41.03104177954081,28.82938027381897', 'gunesli-baglar-mh-cadde-ustu-genis-cepheli-dukkan', '1');
INSERT INTO `ilanlar` VALUES ('3072', 'GÜNEŞLİ HÜRRİYET MAH.ÇOK KULLANIŞLI HARİKA DUBLEKS DAİRE', '345.000 TL', 'İstanbul', 'Bağcılar', 'Hürriyet Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\"><font color=\"#ff0000\">AKEL</font> EMLAK tan</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">3 CEPHESİ AÇIK ÖNÜ KAPANMAZ GÜNEY-DOĞU-KUZEY CEPHELİ</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">YÜKSEK TAVANLI-TERASLI</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">2 mutfak 2 banyolu</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">katta tek daire</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">SIFIR DUBLEKS DAİRE SATILIKTIR</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">AYDINLIK GENİŞ ODALI </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">ÖZENLİ İŞÇİLİK-MODERN MİMARİ </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">ASANSÖRLÜ</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">İSKANLI</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">YÜRÜYÜŞ YOLUNA YAKIN </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">0532 413 28 71</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">Aynur Küçükel</font></p>', '41.0263928763966,28.83059799671173', 'gunesli-hurriyet-mah-cok-kullanisli-harika-dubleks-daire', '1');
INSERT INTO `ilanlar` VALUES ('3073', 'polat port residence havuz cepheli 2+1 satılık', '330.000 TL', 'İstanbul', 'Bağcılar', 'Mahmutbey Mah.', 'Aynur Küçükel', '<p><strong><font color=\"#ff0000\">NOT:MECİDİYEKÖY DEN GELİCEK OLAN METRO HATTININ BIR DURUĞIDA SİTEMİZİN HEMEN ALTINDA OLACAKTIR.(METRO ÇALIŞMASI ŞU AN MAHMUTBEY METRO İSTASYONUNUN ORADA DEVAM ETMEKTEDİR.)</font></strong></p><p><strong>İKİTELLİ ORGANİZE ye ve İSTOÇ a hakim bir konumda,OTOBANA çıkışına yakın,KEMERBURGAZ Üniversitesine komşu PRESTİJLİ VE OTURUMA HAZIRDIR.</strong></p><p><strong>EBEVEYN BANYOSU,MUTFAK ankastreleri (buzdolabı dahil) mevcuttur.çelik kasalı ve çift asansörlüdür.</strong></p><p><u><strong>KİRA GETİRİSİ 1500 TL DİR.</strong></u></p><p><strong>Polat Port Residence İstanbul Bağcılar&apos;a bağlı Mahmutbey Hacıbostan Mahallesi&apos;nde yükseliyor. Polat İnşaat tarafından inşa edilen Polat Port Residence&apos;ta 82 daire yer alıyor</strong></p><p><strong>Polat Port Residence&apos;in kapısından içeri adım attığınızda huzurlu, güvenli ve konforlu bir yaşama da merhaba diyeceksiniz. İş yeri stresi, işin yoruculuğu, trafiğin sıkıntısı, gürültü, kalabalık gibi sizi yoran ne varsa kapıdan içeri girdiğinizde hepsi dışarıda kalacak. Şehrin ortasında ama bir o kadar uzakta hissi veren yeni yaşam alanınızda her anınız eğlenceli, keyifli, güvenli ve doğayla iç içe geçecek.</strong></p><p><strong>Zamanın her anını dolu dolu yaşayın...<br /><br />Polat Port Residence özel mimarisiyle ve her detayı düşünülerek planlanmış daireleriyle sizlere yeni bir yaşam şekli sunuyor. İçeriye adım attığınız andan itibaren yaşadığınız her anın keyfini sürebilceğiniz zengin sosyal alanlarıyla sizlere zamanı dolu dolu yaşatıyor. Son sistem teknoloji aletleriyle donatılmış, sağlıklı ve formda kalmanızı sağlayan Fitness Center... Dört mevsim yüzebilceğiniz Açık ve Kapalı Yüzme Havuzu... Aile fertleriyle veya sevdiklerinizle birlikte yapacağınız heyecanlı maçlar için Tenis Kortu... Gün boyu zinde kalmak için ihtiyacınız olan arınma ve rahatlama için Sauna... Bol skorlu maçlar oynamak için özel Basket Sahası... Günün yorğunluğunu üzerinizden atmanızı sağlayan Hamamı...</strong></p><p> </p><p><strong>AKEL EMLAK </strong></p><p><strong>Aynur Küçükel</strong></p><p><strong>0532 413 28 71</strong></p><p> </p>', '41.0572688411,28.8199388981', 'polat-port-residence-havuz-cepheli-2-1-satilik', '1');
INSERT INTO `ilanlar` VALUES ('3074', 'POLAT PORT RESİDENCE&#039;DE ÇOK UYGUN FİYATA 2+1 FIRSAT DAİRE', '400.000 TL', 'İstanbul', 'Bağcılar', 'Mahmutbey Mah.', 'Erdal Koruk', '<p><b><span style=\"color: black;\">İKİTELLİ ORGANİZE ye ve İSTOÇ a hakim bir\nkonumda,OTOBANA çıkışına yakın,KEMERBURGAZ Üniversitesine komşu PRESTİJLİ VE\nOTURUMA HAZIRDIR.</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">EBEVEYN BANYOLU</span></b></p><p><b><span style=\"color: black;\">MUTFAK ankastreleri mevcuttur (buzdolabı\ndahil) çelik kasalı ve çift asansörlüdür.</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">BALKONLU</span></b></p><p><b><u><span style=\"color: black;background-color: rgb(255, 0, 0);\">KİRA GETİRİSİ 1500 TL DİR. daire&apos;nin fiyatı emsallerine göre gayet uygundur.</span></u></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">Polat Port Residence İstanbul Bağcılar&apos;ın hızla yükselen Mahmutbey Mahallesinde Polat İnşaat tarafında inşa edilen Polat Port Residence&apos;ta 82 daire yer alıyor</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">Polat Port Residence&apos;in kapısından içeri\nadım attığınızda huzurlu, güvenli ve konforlu bir yaşama da merhaba\ndiyeceksiniz. İş yeri stresi, işin yoruculuğu, trafiğin sıkıntısı, gürültü,\nkalabalık gibi sizi yoran ne varsa kapıdan içeri girdiğinizde hepsi dışarıda\nkalacak. Şehrin ortasında ama bir o kadar uzakta hissi veren yeni yaşam\nalanınızda her anınız eğlenceli, keyifli, güvenli ve doğayla iç içe geçecek.</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">Zamanın her anını dolu dolu yaşayın...<br />\n<br />\nPolat Port Residence özel mimarisiyle ve her detayı düşünülerek planlanmış\ndaireleriyle sizlere yeni bir yaşam şekli sunuyor. İçeriye adım attığınız andan\nitibaren yaşadığınız her anın keyfini sürebilceğiniz zengin sosyal alanlarıyla\nsizlere zamanı dolu dolu yaşatıyor. Son sistem teknoloji aletleriyle\ndonatılmış, sağlıklı ve formda kalmanızı sağlayan </span></b></p><p><b><span style=\"color: black;\">Fitness Center... </span></b></p><p><b><span style=\"color: black;\">Dört mevsim yüzebilceğiniz Açık ve Kapalı\nYüzme Havuzu...</span></b></p><p><b><span style=\"color: black;\"><span> </span>Aile fertleriyle veya sevdiklerinizle birlikte\nyapacağınız heyecanlı maçlar için Tenis Kortu... </span></b></p><p><b><span style=\"color: black;\">Gün boyu zinde kalmak için ihtiyacınız\nolan arınma ve rahatlama için Sauna... </span></b></p><p><b><span style=\"color: black;\">Bol skorlu maçlar oynamak için özel Basket\nSahası...</span></b></p><p><b><span style=\"color: black;\">Günün yorğunluğunu üzerinizden atmanızı\nsağlayan Türk Hamamı...</span></b></p><p style=\"text-align: justify;\"><span style=\"background-color: rgb(255, 0, 0);\"><b><span style=\"color: black;\">Portföyümde yer alan bu\ngayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek yerinde\ngörmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim\nbilgilerinden tarafıma ulaşabilirsiniz.</span></b><span style=\"color: black;\"></span></span></p><p style=\"text-align: justify;\"><span style=\"background-color: rgb(255, 0, 0);\"><b><span style=\"color: black;\">Saygılarımla</span></b><span style=\"color: black;\"></span></span></p><p style=\"text-align: justify;\"><span style=\"background-color: rgb(255, 0, 0);\"><b><span style=\"color: black;\">Erdal KORUK</span></b><span style=\"color: black;\"></span></span></p><p style=\"text-align: justify;\"><span style=\"background-color: rgb(255, 0, 0);\"><b><span style=\"color: black;\">Gayrimenkul Yatırım\nDanışmanı</span></b><span style=\"color: black;\"></span></span></p><p style=\"text-align: justify;\"><span style=\"background-color: rgb(255, 0, 0);\"><b><span style=\"color: black;\">Gayrimenkul Kurumsal\nPortföy Satış Yöneticisi</span></b><span style=\"color: black;\"></span></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;background-color: rgb(255, 0, 0);\">Cep Telefonu 0539 565 23\n26</span></b><span style=\"color: black;\"></span></p>', '41.05646892603862,28.81589412689209', 'polat-port-residence-039-de-cok-uygun-fiyata-2-1-firsat-daire', '1');
INSERT INTO `ilanlar` VALUES ('3075', 'MAHMUTBEY METROYA ÇOK YAKIN BİR PROJEDE 3+1 EBEVEYN BANYOLU', '450.000 TL', 'İstanbul', 'Bağcılar', 'Demirkapı Mah.', 'Erdal Koruk', '<p style=\"text-align: center;\"><strong><span style=\"color: red;\">AKEL EMLAK&apos;TAN</span></strong></p><p style=\"text-align: center;\"><strong><span style=\"color: red;\">FIRSAT DAİRE</span></strong></p><p style=\"text-align: center;\"><strong><span style=\"color: red;\">* NİTELİKLİ BİR PROJEDE ERKEN YATIRIM FIRSATI</span></strong></p><p style=\"text-align: center;\"><strong><span style=\"color: red;\"></span></strong></p><p style=\"text-align: center;\"><strong><span style=\"color: red;\">* SİZDE YATIRIMLARINIZI DEĞER KAZANAN\nBU LOKASYONDA FIRSATA ÇEVİRE BİLİRSİNİZ</span></strong></p><p><span style=\"color: black;\"></span></p><p style=\"text-align: center;\"><strong><span style=\"color: red;\">*\nANKASTRELİ,EBEVEYN BANYOLU,1.SINIF YER DÖŞEMELİ,DOĞAL GAZ KOMBİ SİSTEMİ,CİDDİ\nGÜVENLİK,KAT HİZMETİ ve DAHA BİR ÇOK ÖZELLİĞİ BUKONUTLAR’DA\n BULABİLİRSİNİZ...</span></strong></p><p style=\"text-align: center;\"><span style=\"color: black;\"></span></p><p><b>ATATÜRK HAVALİMANINA\n10 DK MESAFEDE</b></p><p><b>MAHMUTBEY METRO&apos;YA ÇOK YAKIN KONUMDA</b></p><p><b>İSTOÇ OTO CENTER\nTEKSTİL KENT MASKO 212 AVM DEPOSİTO AVM MALL OF İSTANBUL AVM SADECE BİRKAÇ\nDAKİKA MESAFEDEDİR ÜSTELİK TÜRKİYENİN EN BÜYÜK ÜNİVERSİTE HASTANESİ OLAN MEDİPOL\nÜNİVERSİTE HASTANESİ,KEMERBURGAZ ÜNİVERSİTESİ, VE BÖLGE İDARE MAHKEMESİNE ÇOK\nYAKIN MESAFEDEDİR.</b></p><p><b><span style=\"color: #00b050;\">1.SINIF MOBİLYA KAPILAR</span></b></p><p><b><span style=\"color: #00b050;\">MUTFAK ANKASTRELERİ </span></b></p><p><b><span style=\"color: #00b050;\">EBEVEYN BANYOLU WC’Lİ BÖLÜM</span></b></p><p><b><span style=\"color: #00b050;\">İLKÖĞRETİM OKULLARINA YÜRÜME MESAFESİNDEDİR.</span></b></p><p><b><span style=\"color: #00b050;\">KAMERALI GÜVENLİK SİSTEMİ</span></b></p><p><b><span style=\"color: #00b050;\">DAİRE ERİŞİMLİ OTOPARK</span></b></p><p><b><span style=\"color: #00b050;\">ÇOCUK OYUN PARKI</span></b></p><p><b><span style=\"color: #00b050;\">KAMELYA DİNLENME ALANLARI</span></b></p><p><b><span style=\"color: #00b050;\">GÖRÜNTÜLÜ DİAFON SİSTEMİ</span></b></p><p><b><span style=\"color: #00b050;\">YANGIN TESİSATI</span></b></p><p><b><span style=\"color: #00b050;\">SU DEPOSU</span></b></p><p><b><span style=\"color: #00b050;\">MERKEZİ UYDU VE KABLOLU TV </span></b></p><p><b><span style=\"color: #00b050;\">ANKASTRE SETİ</span></b></p><p><b><span style=\"color: #00b050;\">RADYA TEMEL </span></b></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Portföyümde\nyer alan bu gayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek\nyerinde görmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim\nbilgilerinden tarafıma ulaşabilirsiniz.</span></b><span style=\"color: red;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Saygılarımla</span></b></p><p style=\"text-align: justify;\"><span style=\"color: red;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Erdal KORUK </span></b></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Cep Telefonu\n(0 539) 565 23 26</span></b><span style=\"color: red;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Gayrimenkül\nYatırım Danışmanı</span></b><span style=\"color: red;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Gayrimenkul\nKurumsal Portföy Satış Yöneticisi</span></b><span style=\"color: red;\"></span></p>', '41.05173142936945,28.831064701080322', 'mahmutbey-metroya-cok-yakin-bir-projede-3-1-ebeveyn-banyolu', '1');
INSERT INTO `ilanlar` VALUES ('3076', 'DEFNE PARK MAHMUTBEY&#039;DE 3+1 122M2 SATILIK FIRSAT DAİRE', '485.000 TL', 'İstanbul', 'Bağcılar', 'Mahmutbey Mah.', 'Erdal Koruk', '<p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" color=\"#ff0000\" size=\"5\">AKEL EMLAK&apos;TAN</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" color=\"#ff0000\" size=\"5\">DEFNE PARK MAHMUTBEY PROJESİNDE SATILIK</font></p><p>DEFNE PARK PROJEMİZ 33 DAİRE VE 2 ADET DÜKKANDAN 1000M2 İNŞAAT ALANINA SAHİPTİR</p><p>FARKLI CEPHE VE KATLARDA 3+1 VE 2+1 DAİRELERİMİZ MEVCUTTUR</p><p>PROJEDE HER DAİREYE AİT KAPALI OTOPARK ÇOCUK OYUN ALANI KAMELYA </p><p>7/24 KAMERALI GÜVENLİK</p><p>HER DAİREDE EBEVEYN BANYOSU</p><p>MUTFAK FULL ANKASTRE</p><p>HİLTON BANYO</p><p>DAİRE İÇİ GÖRÜNTÜLÜ DİAFON SİSTEMİ</p><p>ASMA TAVAN SPOT LED AYDINLATMA VE GİZLİ IŞIK SİSTEMİ</p><p>GİRİŞTE PORT MANTO</p><p>YÜKSEK İNŞAAT KALİTESİ</p><p>ESTETİK GÖRÜNTÜYE ÖZEN GÖSTEREN MİMARİ</p><p>İKİ ADET BALKON</p><p>DEFNE PARK PROJEMİZ KONUMU İLE TUM TOPLU TASIMA ARAÇLARININ GÜZERGAHI ÜZERİNDE YER ALMATADIR</p><p>MAHMUTBEY METRO İSTASYONUNA 300MT MESAFEDE</p><p>TEM OTOYOLUNA 1,5 KM MESAFEDE</p><p>BASIN EKSPRESS YOLU 2KM MESAFEDE</p><p>DETAYLAR İÇİN ARAYINIZ </p><p>ERDAL KORUK 0533 453 83 43</p><p><br /></p>', '41.04669522124208,28.82988452911377', 'defne-park-mahmutbey-039-de-3-1-122m2-satilik-firsat-daire', '1');
