INSERT INTO `ilanlar` VALUES ('3081', '3+1 ÇİFT CEPHE EBEVEYN BANYOLU 115 M2 NET SATILIK SON ÜÇ DAİRE', '375.000 TL', 'İstanbul', 'Bağcılar', 'Fevziçakmak Mah.', 'Erdal Koruk', '<p>FEVZİ ÇAKMAK MAHALLESİNİN EN GÜZEL YERİNDE BULUNAN DAİRELERİMİZ </p><p>ŞİŞE CAM BLOKLARI VE ÇINAR OLİMPİA PARK EVLERİNE KOMŞU KONUMDADIR</p><p>BİNA ÇİFT CEPHE OLUP BİR TARAFI ÇOCUK OYUN PARKINA BAKMAKTADIR ÖNÜ AÇIKTIR</p><p>İSKAN YÖNETMELİĞİ VE DEPREM YÖNETMELİĞİNE UYGUN İNŞA EDİLMİŞTİR</p><p>ISI YALITIM  SES YALITIM ASANSÖR SU DEPOSU MEVCUTTUR</p><p>BİNANIN İNŞAATINDA C 30 BETON KULLANILMIŞ KALİTE VE SAĞLAMLIKTAN KESİNLİKLE ÖDÜN VERİLMEMİŞTİR</p><p>3+1 EBEVEYN BANYOLU </p><p>FIRAT PEN DOĞRAMA </p><p>DIŞ CEPHE KOMPOZİT GİYDİRME</p><p>KATLAR ARASI SES İZALASYON</p><p>SATEN ALÇI DUVARLAR</p><p>ÇİFT CEPHEDE BALKON</p><p>GENİŞ AYDINLIK VE FERAH ODALAR </p><p>KALİTELİ MALZEME VE İŞÇİLİK</p><p>DAİRELERİMİZ KONUMU İLE OKUL MARKET SEMT PAZARI TOPLU TAŞIMA YANI BAŞINIZDA<span> </span></p><p>SON ÜÇ ADET DAİREMİZ 2 AY SONRA TESLİM EDİLECEKTİR</p><p>DAİRELERİMİZİ GÖRMEDEN DAİRE ALMAYA KARAR VERMEYİN </p><p>RANDEVU İÇİN </p><p>ERDAL KORUK 0533 453 83 43 </p>', '41.04521978553,28.85259747505188', '3-1-cift-cephe-ebeveyn-banyolu-115-m2-net-satilik-son-uc-daire', '1');
INSERT INTO `ilanlar` VALUES ('3082', 'AKEL EMLAK&#039;TAN CORNER LİFE&#039;DE UYGUN FİYATA 1+1 SATILIK', '350.000 TL', 'İstanbul', 'Bağcılar', 'Mahmutbey Mah.', 'Erdal Koruk', '<p style=\"text-align: center;\"><strong><font face=\"arial black, sans-serif\" color=\"#ff0000\" size=\"5\">AKEL EMLAK&apos;TAN</font> </strong></p><p><strong><span style=\"color: black;\">Güneşli bir yaşam\nartık şehrin tam ortasında sizleri bekliyor...,</span></strong></p><p><strong><span style=\"color: black;\">Gün ışığından\nolabildiğince yararlanmak için tasarlanan ferah mimari tasarımı ile,\nİstanbul’un keyfini doyasıya çıkaracaksınız... </span></strong></p><p><strong><span style=\"color: black;\">Toplam inşaat\nalanı 5900 m2 olan projede, 4900m2 açık, 1000m2 kapalı sosyal tesis alanı, 2\nbloklu site içerisinde, </span></strong></p><p><strong><span style=\"color: black;\"><br /></span></strong></p><p><strong><span style=\"color: black;\">Dairemiz balkonludur</span></strong></p><p><strong><span style=\"color: black;\">Açık kapalı yüzme\nhavuzu </span></strong></p><p><strong><span style=\"color: black;\">Geniş bahçe </span></strong></p><p><strong><span style=\"color: black;\">Açık kapalı\notopark </span></strong></p><p><strong><span style=\"color: black;\">7 / 24 güvenlik </span></strong></p><p><strong><span style=\"color: black;\">Alış veriş\nmağazaları </span></strong></p><p><strong><span style=\"color: black;\">Çocuk parkı</span></strong></p><p><strong><span style=\"color: black;\">fitness, sauna,\nhamam, tenis kortu, basket sahası, mini futbol sahası</span></strong></p><p><strong><span style=\"color: black;\">Açık spor alanı,\nkoşu alanı, amfi tiyatro, kapalı cep sinema salonu</span></strong></p><p><strong><span style=\"color: black;\">Süper lüks lobi,\nçocuk oyun odası, vitamin bar, market </span></strong></p><p><strong><span style=\"color: black;\">Kamelyalar gibi\nüniteleri ile yaşamınız artık çok daha kaliteli olacak. </span></strong></p><p><strong><span style=\"color: black;\">Projemiz basın\nekspres yolunun yanıbaşında 212 ve starcity alışveriş merkezlerine birkaç\ndakika mesafede merkezi bir yerdedir. </span></strong></p><p><strong><span style=\"color: black;\">Proje deprem\nyönetmeliğine uygun olarak yapılmıştır ve radye temel perde betonludur. </span></strong></p><p><strong><span style=\"color: black;\">Binanın dış\ncephesi mantolama olup ısı ve ses yalıtımı sağlanmıştır. bina modern mimariye\nsahip olup fransız balkonludur. </span></strong></p><p><strong><span style=\"color: black;\">Binanın altında\nkapalı otopark mevcut olup asansör otoparka kadar inmektedir. </span></strong></p><p><strong><span style=\"color: black;\">Her blokta yangın\nmerdiveni ve yangın alarmı vardır. </span></strong></p><p><strong><span style=\"color: black;\">Salonunda klima, antrede\nise gömme dolap ve vestiyer mevcuttur. </span></strong></p><p><strong><span style=\"color: black;\">Ankastre mutfak\nolup teka bulaşık makinası, fırın, ocak ve davlunbaz takılıdır.</span></strong></p><p><strong><span style=\"color: black;\">Dairenin kira getirisi 1500tl dir </span></strong></p><p><strong><span style=\"color: black;\"><br /></span></strong></p><p><strong><span style=\"color: black;\">Diğer ilanlarımız\niçin:  http://akelemlak.com/</span></strong></p><p><br /></p><p><strong><span style=\"color: black;\">Erdal koruk 0533\n453 83 43</span></strong></p>', '41.04543016673171,28.814810514450073', 'akel-emlak-039-tan-corner-life-039-de-uygun-fiyata-1-1-satilik', '1');
INSERT INTO `ilanlar` VALUES ('3083', 'AKEL den çınar olimpia parkta en güzel cephe 3+1 satılık', '525.000 TL', 'İstanbul', 'Bağcılar', 'Fevziçakmak Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><font color=\"#ff0000\" size=\"4\"><span><b>2 ETAP G BLOKTAKİ DAİREMİZ</b></span></font></p><p style=\"text-align: center;\"><span style=\"color: #0000ff;\"><span><span><strong>sitedeki en iyi görsele sahip dairedir.</strong></span></span></span></p><p style=\"text-align: center;\"><span><span><strong>* SATILIK 3+1 daire</strong></span></span></p><p style=\"text-align: center;\"><span><span><span style=\"color: rgb(255,0,0);\"><strong>BAĞCILAR İlçesinin merkezinde bulunan ÇINAR olimpia park sitesi</strong></span></span></span></p><p style=\"text-align: center;\"><span><span><span style=\"color: rgb(255,0,0);\"><strong>Metar grup güvencesi ile imal edilmiş,mimarisi ile de göz dolduran prestijli bir projedir.</strong></span></span></span></p><p style=\"text-align: center;\"><span><span><span style=\"color: rgb(255,0,0);\"><strong>Ulaşım kolaylığı ile de tercih edilen,tek ve komple bir site projesidir.</strong></span></span></span></p><p style=\"text-align: center;\"> </p><p style=\"text-align: center;\"><span><span><strong>* sitedeki yaşam için oradaki daire sahiplerimiz referanslarımızdır.</strong></span></span></p><p style=\"text-align: center;\"> </p><p style=\"text-align: center;\"> </p><p style=\"text-align: center;\"> </p><table style=\"width: 710px;\"><tbody><tr><td style=\"height: 197px;width: 355px;\">			<p style=\"text-align: center;\"><span><span><strong>* kira getirisi :1750 tl&apos;dir.</strong></span></span></p>			<p style=\"text-align: center;\"><span><span><span style=\"color: rgb(255,0,0);\"><strong>BAĞCILAR MERKEZDE 21 BLOKTAN OLUŞAN SİTE İÇERİSİNDE SÜPER LÜKS DARİRELER. 7/24 GÜVENLİK, AÇIK - KAPALI YÜZME HAVUZU, ÇOCUK HAVUZU, SPOR TESİSLERİ, TENİS KORTU, SAUNA, FITNES GİBİ BİRÇOK SOSYAL İMKANLARI OLAN MUHTEŞEM BİR SİTE...</strong></span></span></