INSERT INTO `ilanlar` VALUES ('3084', 'AKEL EMLAK&#039;TAN MAHMUTBEY METRO&#039;YA ÇOK YAKIN 3+1', '475.000 TL', 'İstanbul', 'Bağcılar', 'Göztepe Mah.', 'Erdal Koruk', '<p style=\"text-align: center;\"><strong><span style=\"color: red;\">* NİTELİKLİ BİR PROJEDE DAİRE SAHİBİ\nOLMA FIRSATI</span></strong></p><p style=\"text-align: center;\"><strong><span style=\"color: red;\"></span></strong></p><p style=\"text-align: center;\"><strong><span style=\"color: red;\">* SİZDE YATIRIMLARINIZI DEĞER KAZANAN\nBU LOKASYONDA FIRSATA ÇEVİRE BİLİRSİNİZ</span></strong></p><p><span style=\"color: black;\"></span></p><p style=\"text-align: center;\"><strong><span style=\"color: red;\">*\nANKASTRELİ,EBEVEYN BANYOLU,1.SINIF YER DÖŞEMELİ,DOĞAL GAZ KOMBİ SİSTEMİ,CİDDİ\nGÜVENLİK,KAT HİZMETİ ve DAHA BİR ÇOK ÖZELLİĞİ BUKONUTLAR’DA\n BULABİLİRSİNİZ...</span></strong></p><p style=\"text-align: center;\"><span style=\"color: black;\"></span></p><p><b>ATATÜRK HAVALİMANINA\n10 DK MESAFEDE</b></p><p><b>MAHMUTBEY METRO İSTASYONUNA YÜRÜME MESAFESİNDE YATIRIM DEĞERİ YÜKSEK BİR KONUMDA</b></p><p><b>İSTOÇ OTO CENTER\nTEKSTİL KENT MASKO 212 AVM DEPOSİTO AVM MALL OF İSTANBUL AVM SADECE BİRKAÇ\nDAKİKA MESAFEDEDİR ÜSTELİK TÜRKİYENİN EN BÜYÜK ÜNİVERSİTE HASTANESİ OLAN MEDİPOL\nÜNİVERSİTE HASTANESİ,KEMERBURGAZ ÜNİVERSİTESİ, VE BÖLGE İDARE MAHKEMESİNE ÇOK\nYAKIN MESAFEDEDİR.</b></p><p><b><span style=\"color: #00b050;\">1.SINIF MOBİLYA KAPILAR</span></b></p><p><b><span style=\"color: #00b050;\">MUTFAK ANKASTRELERİ </span></b></p><p><b><span style=\"color: #00b050;\">EBEVEYN BANYOLU WC’Lİ BÖLÜM</span></b></p><p><b><span style=\"color: #00b050;\">İLKÖĞRETİM OKULLARINA YÜRÜME MESAFESİNDEDİR.</span></b></p><p><b><span style=\"color: #00b050;\">KAMERALI GÜVENLİK SİSTEMİ</span></b></p><p><b><span style=\"color: #00b050;\">DAİRE ERİŞİMLİ OTOPARK</span></b></p><p><b><span style=\"color: #00b050;\">ÇOCUK OYUN PARKI</span></b></p><p><b><span style=\"color: #00b050;\">KAMELYA DİNLENME ALANLARI</span></b></p><p><b><span style=\"color: #00b050;\">GÖRÜNTÜLÜ DİAFON SİSTEMİ</span></b></p><p><b><span style=\"color: #00b050;\">YANGIN TESİSATI</span></b></p><p><b><span style=\"color: #00b050;\">SU DEPOSU</span></b></p><p><b><span style=\"color: #00b050;\">MERKEZİ UYDU VE KABLOLU TV </span></b></p><p><b><span style=\"color: #00b050;\">ANKASTRE SETİ</span></b></p><p><b><span style=\"color: #00b050;\">RADYA TEMEL </span></b></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Portföyümde\nyer alan bu gayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek\nyerinde görmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim\nbilgilerinden tarafıma ulaşabilirsiniz.</span></b><span style=\"color: red;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Saygılarımla</span></b></p><p style=\"text-align: justify;\"><span style=\"color: red;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Erdal KORUK </span></b></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Cep Telefonu\n(0 539) 565 23 26</span></b><span style=\"color: red;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Gayrimenkül\nYatırım Danışmanı</span></b><span style=\"color: red;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: red;\">Gayrimenkul\nKurumsal Portföy Satış Yöneticisi</span></b><span style=\"color: red;\"></span></p>', '41.05821638910642,28.832030296325684', 'akel-emlak-039-tan-mahmutbey-metro-039-ya-cok-yakin-3-1', '1');
