INSERT INTO `ilanlar` VALUES ('3088', 'AKEL den yeni mahalle metroya çok yakın sıfır site 3+1 satılık', '485.000 TL', 'İstanbul', 'Bağcılar', 'Yenimahalle Mah.', 'Aynur Küçükel', '<p style=\"color: rgb(0, 0, 0);text-align: center;\"><strong><font size=\"6\"><font color=\"#fff0f5\"><span style=\"background-color: rgb(255, 0, 0);\">AKEL EMLAK</span><span> </span></font><font color=\"#ff0000\">tan </font></font></strong></p><p style=\"text-align: center;\"><strong><font size=\"5\"><font><br /></font></font></strong></p><p style=\"text-align: center;\"><strong><font size=\"5\"><font>SAYF İSTANBUL PROJESİNDE 135 M2 </font></font></strong></p><p style=\"text-align: center;\"><strong><font size=\"5\"><font color=\"#0000cd\"><u>İLK FOTOĞRAF DAİREMİZDEN ÇEKİLMİŞTİR.DAİREMİZ 8 KAT,BATI CEPHELİ ve BELEDİYE PARKINA BAKAN TARAFTIR.SİTENİN EN İYİ ŞEREFİYELİ DAİRESİDİR.</u></font></font></strong></p><p style=\"text-align: center;\"><strong><font size=\"5\"><font color=\"#ff0000\"> EBEVEYN BANYOLU ve GENİŞ BALKONLU</font></font></strong></p><p style=\"text-align: center;\"><font size=\"5\"><span><b>YENİ MAHALLE METROYA ÇOK(2-3 dk yürüme mesafesinde)YAKIN MESAFEDE </b></span></font></p><p style=\"text-align: center;\"><font color=\"#ff0000\" size=\"5\"><span><b>OTURUM OLAN SAYF YAPI 2500 M2 ARSA İÇİNDE</b></span></font></p><p style=\"text-align: center;\"><font size=\"5\"><span><b>ÇİFT ASANSÖRLÜ</b></span></font></p><p style=\"text-align: center;\"><font size=\"5\"><span><b>GENİŞ PEYZAJLI ,ÇOÇUK OYUN PARKI</b></span></font></p><p style=\"text-align: center;\"><font size=\"5\"><span><b>2500 M2 OTOPARK ALANI</b></span></font></p><p style=\"text-align: center;\"><font size=\"5\"><span><b>iletişim : 0532 413 28 71</b></span></font></p><p style=\"text-align: center;\"><br /></p><p style=\"text-align: center;\"><font color=\"#ff0000\" size=\"5\"><span><b><br /></b></span></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><br /></p>', '41.03868144987635,28.839057683944702', 'akel-den-yeni-mahalle-metroya-cok-yakin-sifir-site-3-1-satilik', '1');
INSERT INTO `ilanlar` VALUES ('3089', '++++ÇINAR OLİMPİA PARKTA HAVUZ MANZARALI 3+1 SATILIK DAİRE', '520.000 TL', 'İstanbul', 'Bağcılar', 'Fevziçakmak Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><strong><font size=\"5\"><font color=\"#fff0f5\"><span style=\"background-color: rgb(255, 0, 0);\">AKEL EMLAK</span> </font><font color=\"#ff0000\">tan SATILIK daire</font></font></strong></p><p style=\"text-align: center;\"><b style=\"color: rgb(255, 0, 0);\"> PEYZAJ MANZARALI 3+1 DAİRE</b></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>BAĞCILAR İlçesinin merkezinde bulunan ÇINAR olimpia park sitesi</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>Metar grup güvencesi ile imal edilmiş,mimarisi ile de göz dolduran prestijli bir projedir.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>Ulaşım kolaylığı ile de tercih edilen komple bir projesidir.</strong></span></p><p style=\"text-align: center;\"><strong><font color=\"#ff0000\">Dairenin tanıtımı : </font></strong></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Detaylı bilgiler kısmındaki iç ve dış özelliklerin tümü eksiksiz mevcuttur.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Mutfakta kiler odası mevcuttur.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Isı izolasyonu teknik şartnameye uygun yapıldığı için kış mevsiminde ısı kaybı minimalize edilmiştir.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Sosyal tesisleri hijyenik olup,sadece bayanlar için ayrılmış günleri vardır.Açık havuzu mevcuttur.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Otopark sıkıntısı yoktur,açık kapalı otoparklıdır.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Ayrıca yük asansörü olup,haricinde 2 asansör daha mevcuttur.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Müstakil jeneratör elektirik kesintilerinde otomatik devreye girmektedir.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*ÖZENLİ bir site yönetimine ve titiz bir güvenliğe sahiptir.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"> </p><p style=\"color: rgb(0, 0, 0);text-align: center;\"> </p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Detaylı bilgi ve dairemizi görmek için <span style=\"color: rgb(255, 0, 0);\"><span>AKEL EMLAK </span> Aynur Küçükel</span></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span style=\"color: rgb(255, 0, 0);\"><span><strong>                                                                            0532 413 28 71</strong></span></span></p>', '41.04352330965054,28.852200508117676', 'cinar-olimpia-parkta-havuz-manzarali-3-1-satilik-daire', '1');
INSERT INTO `ilanlar` VALUES ('3090', 'GÜNEŞLİ MEYDAN DA ESKİ ÇARŞAMBA PAZARINA CEPHE 3+1 SATILIK DAİRE', '350.000 TL', 'İstanbul', 'Bağcılar', 'Hürriyet Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><font size=\"4\" face=\"arial black, sans-serif\">AKEL EMLAK TAN</font></p><p style=\"text-align: center;\"><font size=\"4\" face=\"arial black, sans-serif\">GÜNEŞLİ MEYDANA 1 DK MESAFEDE</font></p><p style=\"text-align: center;\"><font size=\"4\" face=\"arial black, sans-serif\">ESKİ ÇARŞAMBA PAZARININ BAŞINDA ,ÇARŞAMBA PAZARINA CEPHE</font></p><p style=\"text-align: center;\"><font size=\"4\" face=\"arial black, sans-serif\">3+1 SATILIK DAİRE</font></p><p style=\"text-align: center;\"><font size=\"4\" face=\"arial black, sans-serif\">ASANSÖRLÜ-OTOPARKLI</font></p><p style=\"text-align: center;\"><font size=\"4\" face=\"arial black, sans-serif\">BALKONLU -WC-BANYO</font></p><p style=\"text-align: center;\"><font size=\"4\" face=\"arial black, sans-serif\">AYDINLIK </font></p><p style=\"text-align: center;\"><font size=\"4\" face=\"arial black, sans-serif\">0532 413 28 71</font></p>', '41.03052873561611,28.828795552253723', 'gunesli-meydan-da-eski-carsamba-pazarina-cephe-3-1-satilik-daire', '1');
INSERT INTO `ilanlar` VALUES ('3091', 'GÜNEŞLİ MEYDAN DA YÜKSEK TAVAN 5+1 DUBLEKS DAİRE', '500.000 TL', 'İstanbul', 'Bağcılar', 'Güneşli Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" color=\"#ff0000\" size=\"4\">AKEL EMLAK TAN</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\"><u>GENİŞ AİLELER İÇİN KAÇIRILMAZ FIRSAT</u></font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" color=\"#ff0000\" size=\"4\">GÜNEŞLİ MEYDAN DA KOÇMAN ÇIKMAZI SOKAKTA,SOKAK BAŞINDA </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" color=\"#ff0000\" size=\"4\">ASANSÖRLÜ(otoparka inmektedir.)-OTOPARKLI </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" color=\"#ff0000\" size=\"4\">İSKANLI BİNADIR</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" color=\"#ff0000\" size=\"4\">BİNAMIZIN ARKASI İMAR PLANLARINDA PARK OLARAK SAĞ YANI İSE ÖNÜ KAPANMAZ CADDE CEPHELİDİR.</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" color=\"#ff0000\" size=\"4\">KAMERA SİSTEMİ VARDIR.</font></p><p style=\"text-align: left;\"><u><b><font size=\"3\">Daire özellikleri :</font></b></u></p><p></p><ul><li style=\"text-align: left;\"><b><font size=\"3\">Alt kat 3+1 dairedir.</font></b></li><li style=\"text-align: left;\"><b><font size=\"3\">üst kat normal kat tavan yüksekliğine sahip,son derece kullanışlıdır.</font></b></li><li style=\"text-align: left;\"><b><font size=\"3\">ayrıca kapısı vardır.</font></b></li><li style=\"text-align: left;\"><b><font size=\"3\">üst katta mutfak,banyo,salon,yatak odası ve teras mevcuttur.</font></b></li><li style=\"text-align: left;\"><b><font size=\"3\">MASRAFSIZDIR.</font></b></li></ul><b></b><div style=\"text-align: left;\"><b><font size=\"3\">iletişim ve dairemizi görmek için 0532 413 28 71</font></b>', '41.031656870561406,28.826698064804077', 'gunesli-meydan-da-yuksek-tavan-5-1-dubleks-daire', '1');
INSERT INTO `ilanlar` VALUES ('3092', 'GÜNEŞLİ DE SATILIK BAHÇE KATI 3+1 DAİRE', '215.000 TL', 'İstanbul', 'Bağcılar', 'Güneşli Mah.', 'Aynur Küçükel', '<p style=\"color: rgb(0, 0, 0);text-align: center;\"><strong><font size=\"5\"><font color=\"#fff0f5\"><span style=\"background-color: rgb(255, 0, 0);\">AKEL EMLAK</span><span> </span></font><font color=\"#ff0000\">tan SATILIK daire</font></font></strong></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><strong><font size=\"5\"><font color=\"#ff0000\">SÜREKLİ DEĞER KAYDEDEN BÖLGEDE ÇOK UYGUN FİYATLI DAİREMİZİ KAÇIRMAYIN...</font></font></strong></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><strong><font size=\"5\"><font color=\"#ff0000\">KREDİYE UYGUN 3+1 SATILIK</font></font></strong></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><strong><font size=\"5\"><font color=\"#ff0000\">EVREN CADDESİNE BİRKAÇ BİNA MESAFEDE</font></font></strong></p><p style=\"text-align: center;\"><font color=\"#0000ff\" size=\"5\"><b>GENİŞ KULLANIMLI </b></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font size=\"5\" color=\"#0000ff\"><b>BAHÇE TERASLI</b></font></p><p style=\"text-align: center;\"><font color=\"#0000ff\" size=\"5\"><b>ÖZEL DEKORLU TADİLATLI</b></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><b style=\"color: rgb(0, 0, 255);\">METRO ve MAHMUTBEY CADDESİNE ÇOK YAKIN KONUMLU</b><br /></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font size=\"5\" color=\"#ff0000\"><b>AYNUR KÜÇÜKEL 0532 413 2871</b></font></p>', '41.03864908026231,28.827770948410034', 'gunesli-de-satilik-bahce-kati-3-1-daire', '1');
INSERT INTO `ilanlar` VALUES ('3093', 'SAHİLPARK EVLERİNDE DENİZ MANZARALI 137 m2 3+1 SATILIK DAİRE', '1.100.000 TL', 'İstanbul', 'Zeytinburnu', 'Sümer Mah.', 'Aynur Küçükel', '<p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" size=\"5\"><span style=\"background-color: rgb(255, 0, 0);\"><font color=\"#ffffff\">AKEL<span> </span></font></span><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#ff0000\">EMLAK TAN</font></span></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">SAHİL PARK PROJESİNDE YÜKSEK KAT ve DENİZ MANZARALI DAİRE</font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" size=\"5\">FULL EŞYALI SATILIKTIR</font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">DAİREMİZ EBEVEYN BANYOLU ve BALKONLUDUR</font></p><p><span><br /></span></p><p><span><font face=\"arial black, sans-serif\" color=\"#ff0000\"><u>SAHİLPARK AYRICALIKLARI</u></font></span><br /><br />•Çağdaş teknolojinin ulaştığı en yüksek kalitede yapı standardı,<br />•	Modern mimari tasarım,<span> </span><br />•	Tüm konut birimlerinde birinci kalite inşaat malzemesi,<span> </span><br />•	P.V.C. doğramalı, ısıcamlı pencereler,<br />•	Endüstriyel ahşap kaplamalı çelik dış kapı,<span> </span><br />•	Özel dizayn ameriken panel kaplamalı iç kapılar,<span> </span><br />•	Spor alanları, süs havuzlu peyzaj düzenlemeleri,<span> </span><br />•	24 saat kesintisiz güvenlik,<span> </span><br />•	Site içi Yürüyüş yolları,<span> </span><br />•	Kapalı devre kamera ve görüntülü intercom,<span> </span><br />•	Uydu sistemi, kablolu yayın ve internet bağlantısı,<br />•	Her daireye kapalı otopark imkânı,<span> </span><br />•	Engelliler için rampalar,</p><p><br /><strong>SİTE GENEL ÖZELLİKLERİ ve AYRICALIKLAR<span> </span></strong><br /><br />•	Site çevresi , güvenlik ve kontrollü giriş - çıkış kapıları olacaktır.<br />•Tüm yaya ve otomobil giriş - çıkışları bu kapılardan yapılacaktır.<br />•	Blok girişlerinden daire içlerine bağlantılı interkom sistemi kurulacaktır.<span> </span><br />•	Site içinde yaya ve otomobil yolları yapılacak, bina yerleşimi olmayan tüm bölümlerde site arazisinin rekreasyon alanlarına ayrılıp, peyzajı yapılacaktır.<span> </span><br />•	Yeşil alanlar için otomatik kontrollü bahçe sulama sistemi kurulacaktır.<br />•	Site sakinlerine de hizmet verecek market ve benzeri ticari bölümler ön cephede yer alan dükkanlarda yer alacaktır.<br />•	Rekreasyon alanları içinde çocuk oyun alanları kamelyalar, küçük su havuzları ve ışıklandırmalar gibi etkinlikler yer alacaktır.<span> </span><br />•	Site içerisinde her daireye en az 1 araç yeri olacak şekilde sağlayacak kapalı otopark alanları oluşturulacaktır.<br />Kapalı otoparklardan bina girişlerine asansörler ile ulaşılacaktır.<br />•	Tüm ortak alanlara jeneratörlerle kesintisiz enerji imkanı sağlanacaktır.</p><p><br /><strong>ZEMİN,TEMEL VE BİNA:</strong><br /><br />•	Binalar betonarme karkas ve tünel kalıp sistem olacaktır. Deprem yönetmeliğine uygun radye temel sistemi, betonarme karkas yapı sistemi uygulanacaktır.<br />•	Dış duvarlar tuğla veya muadili, iç duvarlar ise tuğla duvar,muadili ve betonarme perde vb. Yapılacaktır.<br />•	Dış cepheler de ısı yönetmeliğine uygun olarak mantolama ısı izolasyonu yapılacak.Silikon veya akrilik esaslı boya ile (suya dayanıklı dış cephe boyası ile), boyanacaktır.<span> </span><br />•	Yapım tekniği temel altı fore kazık ve rayde temel tünel kalıp sistemidir.<span> </span><br />•	Temel ve bordum kat perdelerinde sinyal tabakalı pvc menbran ile bohçalama su izolasyonu, yapı çevre, sahalarda ve yağmur suyu drenaj sistemi yapılacaktır.</p><p><br /><strong>SU, SES VE ISI YALITIMI :<br /></strong><br />•	Bina bodrumlarında tavanda ısı yalıtımı yapılacaktır.<span> </span><br />•	Hidrofor ve su depolarının olduğu mahallarde ve gereken binalarda ses yalıtımı yapılacaktır.<span> </span><br />•	Darbe sesi yalıtımı için döşemelerde şap altına yalıtım şiltesi kullanılacaktır.<span> </span><br /><br /><strong>ÇATILAR:<span> </span></strong><br /><br />•	Isı ve su yalıtımı uygulanmış teras çatı olacak.<span> </span><br /><br /><strong>DOĞRAMALAR:<span> </span></strong><br /><br />•	Isı ve ses izolasyonlu çift camlı pvc doğrama yapılacaktır.<span> </span><br /><br /><strong>DIŞ KAPI:</strong><br /><br />•	Daire giriş kapıları endüstriyel ahşap kaplamalı çelik kapı olacaktır<br />.<span> </span><br /><strong>İÇ KAPILAR:</strong><br /><br />•	Özel dizayn amerikan panel kaplamalı iç kapılar kullanılacaktır.<span> </span><br />•Salon ve mutfak kapıları camlı kapı olacaktır.</p><p><strong>TAVAN:<span> </span></strong><br /><br />•	Bütün tavanlarda alçı perdah üzeri su bazlı plastik boya kullanılacaktır.<span> </span><br /><br /><strong>DUVARLAR:<span> </span></strong><br /><br />•	Bütün duvarlarda alçı sıva üzeri su bazlı saten boya kullanılacaktır.<span> </span><br /><br /><strong>ISLAK ZEMİNLER:<span> </span></strong><br /><br />•	1.sınıf seramik yer kaplaması kullanılacaktır.<span> </span><br />•	Suya karşı bütün ıslak mekanların su izolasyonu yapılacaktır.<span> </span><br /><br /><strong>SALON VE ODA ZEMİNLERİ:<span> </span></strong><br /><br />•	1. Sınıf Laminat parke yer kaplaması kullanılacaktır.<span> </span><br /><strong><br />ANTRE, KORİDOR VE HOL ZEMİNLERİ:<span> </span><br /></strong><br />•	1. Sınıf seramik yer kaplaması kullanılacaktır.<span> </span><br /><br /><strong>BANYO VE MUTFAK DOLAPLARI:<span> </span></strong><br /><br />•	1. Sınıf özel melamin-laminat kaplamalı dolaplar yapılacaktır.<span> </span><br /><br /><strong>ISITMA :<span> </span></strong><br /><br />•	Doğalgaz yakıtlı yuksek verimli merkezi ısıtma ve akilli bina	sistemine uygun kalorimetre uygulamalı ısıtma sistemi, Banyolarda dekoratif havlu-pan radyatörler.<span> </span><br />• Tüm odalarda Termostatik vanali panel radyatörler kullanılacaktır. Banyo havalandırması banyo da menfezler ile yapılacaktır.<span> </span><br /><br /><strong>SIHHI TESİSAT:<span> </span></strong><br /><br />•	Birinci sınıf armatür ve vitrifiyeler kullanılacaktır.<span> </span><br />•	Sıcak su merkezi sistemden sağlanacak olup, soğuk su, apartman bloklarındaki su depolarında depolanan şebeke suyundan temin edilecektir.<span> </span><br />•	Mutfaklarda dogal gaz<br />•	Garajlarda springler sistemi ve genel mahallerde yangin sondurme sistemi<br /><br /><strong>ELEKTRİK:</strong><br /><br />•	Dekoratif anahtar ve prizler, bataryalı güvenlik aydınlatması, paratoner sistemi ile yıldırımdan korunma sistemi, temel topraklama tesisatı, bireysel sayaç sistemi kullanılacaktır.<span> </span><br />•	Görüntülü interkom sistemi yapılacaktır.<span> </span><br />•	Daire içlerinde gaz ve yangın alarm sistemi ortak alanlarda yangın alarm sistemi kurulacaktır.<span> </span><br />•	Elektrik kazalarına karşı kaçak akım koruma şalteri kullanılacaktır.<br /><br /><strong>ASANSÖRLER:<span> </span></strong><br />•Kapalı ve acil durum asansörleri, havalandırmalı güvenlik alarmlı, deprem sensörlü, ses bağlantılı asansörler kullanılacaktır</p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\">AYNUR KÜÇÜKEL 0532 413 2871</font></p><p style=\"text-align: left;\"><br /></p>', '40.99086721265246,28.894112706184387', 'sahilpark-evlerinde-deniz-manzarali-137-m2-3-1-satilik-daire', '1');
INSERT INTO `ilanlar` VALUES ('3094', 'GÜNEŞLİ EVREN CADDESİNE ÇOK YAKIN DEPOLAMA VE İMALATHANEYE UYGUN', '6.000 TL', 'İstanbul', 'Bağcılar', 'Evren Mah.', 'Erdal Koruk', '<p>DÜKKANIMIZ 3 KATLIDIR TOPLAM 600M2</p><p>1 KATTA VİTRİNLİ 200M2</p><p>GİRİŞ 200 M2</p><p>BODRUM 200M2</p><p>TAVAN YÜKSEKLİĞİ 3.50H</p><p>ASANSÖR MEVCUT</p><p>HER İŞE UYGUNDUR</p><p>DETAYLAR İÇİN ARAYINIZ</p><p>ERDAL KORUK 0533 453 83 43</p><p><br /></p><p><br /></p>', '41.03254396231399,28.81462275981903', 'gunesli-evren-caddesine-cok-yakin-depolama-ve-imalathaneye-uygun', '1');
INSERT INTO `ilanlar` VALUES ('3095', 'MAHMUTBEY YOLUNA ÇOK YAKIN 2+1 KULLANIŞLI SIFIR DAİRE', '250.000 TL', 'İstanbul', 'Bağcılar', 'Hürriyet Mah.', 'Erdal Koruk', '<p>DAİREMİZ MAHMUTBEY YOLUNA GÜNEŞLİ MEYDANA VE SABİT HALK PAZARINA ÇOK YAKIN MESAFEDEDİR</p><p>HER DAKİKA TOPLU TAŞIMA ARAÇLARI KAPINIZ HEMEN YANINDAN GEÇMEKTEDİR </p><p>İLKÖĞRETİM LİSE GİBİ ÖĞRETİM KURUMLARINA YÜRÜME MESAFESİNDEDİR</p><p>DAİREMİZİN KABA İŞÇİLİĞİ BİTMİŞ İNCE İŞÇİLİĞİDE 1 AY GİBİ KISA BİR ZAMANDA TAMAMLANACAKTIR</p><p>DAİRELERİN TAPULARI HAZIRDIR KREDİ KULLANILA BİLİR </p><p>DETAYLAR İÇİN ARAYINIZ</p><p>ERDAL KORUK</p>', '41.029860141194035,28.83309245109558', 'mahmutbey-yoluna-cok-yakin-2-1-kullanisli-sifir-daire', '1');
INSERT INTO `ilanlar` VALUES ('3096', 'AKEL EMLAK&#039;TAN KÖŞEBAŞI TABELA DEĞERİ YÜKSEK SATILIK DÜKKANLAR', '1.200.000 TL', 'İstanbul', 'Bağcılar', 'Hürriyet Mah.', 'Erdal Koruk', '<p>DÜKKANLARIMIZ BAĞCILAR HÜRRİYET MAHALLESİNİN ENGÜZEL VE EN İŞLEK YERİNDEDİR</p><p>YÜRÜYÜŞ YOLU VE ANACADDENİN KESİŞTİĞİ KÖŞE BAŞINDADIR</p><p>SATIŞTAKİ DÜKKANLARIMIZI 20 M2 İLE 130 M2 ARALIĞINDA&apos;DIR</p><p>DÜKKANLARIMIZIN İSKANI ALINMIŞ KREDİYE UYUNDUR</p><p>DETAYLAR İÇİN </p><p>ERDAL KORUK 0533 453 83 43</p><p><br /></p>', '41.02237147041453,28.830206394195557', 'akel-emlak-039-tan-kosebasi-tabela-degeri-yuksek-satilik-dukkanlar', '1');
INSERT INTO `ilanlar` VALUES ('3097', 'YATIRIMCIYA GÜNEŞLİ MEYDAN&#039;DA TABELA DEĞERİ YÜKSEK KİRACILI', '3.250.000 TL', 'İstanbul', 'Bağcılar', 'Güneşli Mah.', 'Erdal Koruk', '<p>DÜKKANIMIZ GÜNEŞLİ MEYDANIN EN GÜZEL VE EN İŞLEK YERİNDEDİR</p><p>İÇERİSİNDEKİ KİRACISI ÜÇ YILLIK KİRACIDIR</p><p>YATIRIMCI İÇİN KUPON YERDİR ARSA PAYI OLDUKÇA YÜKSEKTİR</p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Portföyümde\nyer alan bu gayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek\nyerinde görmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim\nbilgilerinden tarafıma ulaşabilirsiniz.</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Saygılarımla</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b></b></p><p><b><b><font color=\"#ff0000\" face=\"arial black, sans-serif\">NOT:PORTFÖYÜN TEK YETKİLİSİ ŞİRKETİMİZDİR</font></b></b></p><p></p><p><font face=\"arial black, sans-serif\" color=\"#ff0000\">DETAYLAR İÇİN ARAYIN </font></p><p><font face=\"arial black, sans-serif\" color=\"#ff0000\">KURUMSAL PORTFÖY YATIRIM DANIŞMANI</font></p><p><font face=\"arial black, sans-serif\" color=\"#ff0000\">ERDAL KORUK</font></p><p><font face=\"arial black, sans-serif\" color=\"#ff0000\">0533 453 83 43</font></p>', '41.03122969652719,28.828747272491455', 'yatirimciya-gunesli-meydan-039-da-tabela-degeri-yuksek-kiracili', '1');
INSERT INTO `ilanlar` VALUES ('3098', 'KİPTAŞ VADİTEPE de 1 ETAP ÖNÜ AÇIK GÖLET MANZARALI 121 m2', '495.000 TL', 'İstanbul', 'Başakşehir', 'Bahçeşehir 1. Kısım Mah.', 'Aynur Küçükel', '<p style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><font face=\"arial black, sans-serif\" size=\"5\">KİPTAŞ VADİTEPE DE 1 ETAPTA C BLOK BATI CEPHELİ</font></p><p style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><font face=\"arial black, sans-serif\" size=\"6\">2+1</font></p><p style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><font face=\"arial black, sans-serif\" size=\"5\">121 m2 ebeveyn banyolu DAİREMİZ SATILIKTIR.</font></p><p style=\"color: rgb(0, 0, 0);background-color: rgb(255, 255, 255);\"><font face=\"arial black, sans-serif\">Bahçeşehir’in en değerli ve en büyük arazisi üzerinde hayata geçireceğimiz Vaditepe Bahçeşehir ile özlediğimiz mahalle kültürünü, modern yaşamın kent olgusu içinde kendine has üslubuyla yeniden yorumluyoruz. Siz değerli hemşehrilerimize, şehrin içinde doğayla iç içe yeni ama geçmişin izlerini taşıyan yeni bir yaşam sunuyoruz. 284 dönümlük bir alana sahip olan projemizde, yeşil alanlar ile spor ve yaşam alanlarına yer verdik. Projenin tam önünde yer alan ve projeye adını veren Bahçeşehir Vadisi, 2 milyon metrekareye yakın yeşil alanıyla Vaditepe’yi çok daha özel kılıyor…<span> </span><br /></font></p><p style=\"color: rgb(0, 0, 0);background-color: rgb(255, 255, 255);\"><font face=\"arial black, sans-serif\"> 25.000 metrekarelik ticari alanların yer aldığı Vaditepe Bahçeşehir’de, birbirinden şık mağazalar, kafeler, restoranlar her gününüze ayrı bir keyif katmak için yeni evinizde sizi bekliyor.<span> </span><br /></font></p><p style=\"color: rgb(0, 0, 0);background-color: rgb(255, 255, 255);\"><font face=\"arial black, sans-serif\"> Aile Sağlığı Merkezi, ilkokul, ortaokul, sağlık ocağı... Hepsi Vaditepe’nin içinde!<span> </span><br /></font></p><p style=\"color: rgb(0, 0, 0);background-color: rgb(255, 255, 255);\"></p><div style=\"text-align: center;color: rgb(34, 34, 34);background-color: rgb(255, 255, 255);\"><span><b><font size=\"4\" face=\"arial black, sans-serif\">* KAPALI YÜZME HAVUZU</font></b></span>', '41.07422556028878,28.695344924926758', 'kiptas-vaditepe-de-1-etap-onu-acik-golet-manzarali-121-m2', '1');
