INSERT INTO `ilanlar` VALUES ('3105', 'EVREN MAH 440 m2 KOMPLE ASANSÖRLÜ 4 KATLI KİRALIK BİNA', '9.000 TL', 'İstanbul', 'Bağcılar', 'Evren Mah.', 'Erdal Koruk', '<p>BİNA  EVREN MAHALLESİNDE METRO MARKET&apos;E ÇOK YAKIN KONUMDADIR</p><p><span>DEPOLAMA İMALAT TEKSTİL OFİS HER İŞE UYGUNDUR</span></p><p><span>ASANSÖR BODRUM DAHİL HER KATA KADAR ÇIKAR</span></p><p><span>KOMPLE KİRAYA VERİLECEKTİR</span></p><p><span>DETAYLI BİLGİ İÇİN ARAYINIZ</span></p><p><span>ERDAL KORUK GAYRİMENKUL YATIRIM DANIŞMANI</span></p><p><span>0533 453 83 43</span></p><p><span><br /></span></p><p><span><br /></span></p>', '41.03342396069725,28.81537914276123', 'evren-mah-440-m2-komple-asansorlu-4-katli-kiralik-bina', '1');
INSERT INTO `ilanlar` VALUES ('3106', 'TEKİRDAĞ YENİCEDE HAVUZLU SİTE İÇİ 65M2 SATILIK BAHÇELİ YAZLIK', '90.000 TL', 'Tekirdağ', 'Çorlu', 'Yenice Bld.', 'Erdal Koruk', '<p>TEKİRDAĞ&apos;IN EN ÇOK TELEP GÖREN BÖLGESİ YENİCEDE </p><p>SAYGIN GÜVENLİKLİ SİTE İÇERİSİNDE </p><p>BAHÇE KATI KENDİ MÜSTAKİL BAHÇESİ VAR</p><p>YAZ BOYU AÇIK YÜZME HAVUZU </p><p>ÇOCUK OYUN ALANI</p><p>MARKET OTOPARK</p><p>KISACASI TÜM İHTİYAÇLARINIZA CEVAP VERECEK KONUMDAKİ YAZLIK DAİRE MAL SAHİBİNİN İŞ YOĞUNLUĞUNDAN KULLANAMADIĞI İÇİN SATILIKTIR MESAFE OLARAK İSTANBUL&apos;A 100 KM TEKİRDAĞ MERKEZE 15KM MESAFEDEDİR</p><p>İSTANBULUN SİTESİNDEN SADECE 1 SAAT UZAKTASINIZ</p><p>SİTENİN YILLIK AİDATI 600 TL DİR</p><p>DETAYLAR İÇİN ARAYINIZ</p><p>ERDAL KORUK GAYRİMENKUL YATIRIM DANIŞMANI</p><p>0 533 453 83 43</p>', '41.00912313617788,27.70648956298828', 'tekirdag-yenicede-havuzlu-site-ici-65m2-satilik-bahceli-yazlik', '1');
INSERT INTO `ilanlar` VALUES ('3107', 'YENİBOSNA&#039;DA 3200M2 KAPALI 800M2 AÇIK ALANLI KİRALIK FABRİKA', '$ 15.000', 'İstanbul', 'Bahçelievler', 'Çobançeşme Mah.', 'Erdal Koruk', '<p style=\"color: rgb(0, 0, 0);text-align: center;\"><b><font face=\"arial black, sans-serif\" size=\"5\" style=\"background-color: rgb(255, 0, 0);\">AKEL EMLAK&apos;TAN </font></b></p><p style=\"color: rgb(0, 0, 0);\">KİRALIK PORTFÖYÜMÜZ TEK KAT ÜZERİNE 3200M2 DİR MÜSTAKİL BİR BİNADIR</p><p style=\"color: rgb(0, 0, 0);\">TAVAN YÜKSEKLİĞİ H 2.70</p><p style=\"color: rgb(0, 0, 0);\">ELEKTRİK GÜCÜ 300 KW</p><p style=\"color: rgb(0, 0, 0);\">ÖZEL GÜVENLİK DUVARI İLE ÇEVRİLİ ÖN BAHÇE 800 M2 TOPLAMDA 4000 M2</p><p style=\"color: rgb(0, 0, 0);\">HER İŞE UYGUN POZİSYONDA OLAN BU İŞ YERİMİZ KAPISININ ÖNÜNE TIR YANAŞIR DURUM DA MÜSTAKİL KULLANIMDADIR</p><p style=\"color: rgb(0, 0, 0);\">E 5 VE BASIN EKSPRES YOLUNA ÇOK YAKIN KONUMDADIR </p><p style=\"color: rgb(0, 0, 0);\">KİRALAMA ŞARTLARI İKİ KİRA DEPOZİT BİR KİRA PEŞİN VE EMLAK KOMİSYONU VARDIR</p><p style=\"color: rgb(0, 0, 0);text-align: justify;\"><b><span style=\"color: black;\">Portföyümde yer alan bu gayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek yerinde görmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim bilgilerinden tarafıma ulaşabilirsiniz.</span></b><span style=\"color: black;\"></span></p><p style=\"color: rgb(0, 0, 0);text-align: justify;\"><b><span style=\"color: black;\">Saygılarımla</span></b><span style=\"color: black;\"></span></p><p style=\"color: rgb(0, 0, 0);text-align: justify;\"><b><span style=\"color: black;\">Erdal KORUK 0533 453 83 43</span></b><span style=\"color: black;\"></span></p><p style=\"color: rgb(0, 0, 0);text-align: justify;\"><b><span style=\"color: black;\">Gayrimenkül Yatırım Danışmanı</span></b></p>', '41.00920510847606,28.825078010559082', 'yenibosna-039-da-3200m2-kapali-800m2-acik-alanli-kiralik-fabrika', '1');
INSERT INTO `ilanlar` VALUES ('3108', 'GÜNEŞLİ MEYDAN&#039;A ÇOK YAKIN 4+2 YÜKSEK TAVAN DUBLEKS DAİRE', '575.000 TL', 'İstanbul', 'Bağcılar', 'Güneşli Mah.', 'Erdal Koruk', '<p>DAİREMİZ GÜNEŞLİ MEYDAN&apos;A ÇOK YAKIN KONUMDADIR BULUNDUĞU SOKAK OLDUKÇA GENİŞTİR HER KATTA 4 DAİRE VARDIR DUBLEKS&apos;İN TAVANI YÜKSEKTİR </p><p>AYRI GİRİŞE AYRI MUTFAK VE BANYO WC YE SAHİP OLDUĞUNDAN İSTENİLİRSE AYRI DAİRE OLARAK KULLANILABİLİR</p><p>ALT KAT 3+1 ALT</p><p>ÜST KAT 1+1 AYRICA ÜST KATTA MUTFAK VE BANYO WC MEVCUTTUR</p><p>BİNANIN YAPIMINDA KULLANILAN MALZEME VE İŞÇİLİK YÜKSEK KALİTEDE KULLANILMIŞTIR</p><p>KREDİYE UYGUNDUR KREDİ KULLANIMINDA YARDIMCI OLUNUR</p><p>DAİRENİN İÇİNDE MÜLK SAHİBİ OTURMAKTADIR YATIRIM AMAÇLI DÜŞÜNÜLÜRSE KİRACI OLARAK KALABİLİR</p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Portföyümde\nyer alan bu gayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek\nyerinde görmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim\nbilgilerinden tarafıma ulaşabilirsiniz.</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Saygılarımla</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Erdal\nKORUK 0533 453 83 43</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Gayrimenkül\nYatırım Danışmanı</span></b><span style=\"color: black;\"></span></p><p><br /></p><p><br /></p>', '41.03226879443331,28.827196955680847', 'gunesli-meydan-039-a-cok-yakin-4-2-yuksek-tavan-dubleks-daire', '1');
INSERT INTO `ilanlar` VALUES ('3109', 'POLAT PORT RESİDENCE de kapalı mutfak havuz cepheli satılık', '440.000 TL', 'İstanbul', 'Bağcılar', 'Mahmutbey Mah.', 'Aynur Küçükel', '<p style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(255, 0, 0);\"><strong>İKİTELLİ ORGANİZE ye ve İSTOÇ a hakim bir konumda,OTOBANA çıkışına yakın,KEMERBURGAZ Üniversitesine komşu PRESTİJLİ VE OTURUMA HAZIRDIR.</strong></span></p><p style=\"color: rgb(0, 0, 0);\"><span style=\"color: rgb(255, 0, 0);\"><strong>EBEVEYN BANYOSU,MUTFAK ankastreleri (buzdolabı dahil) mevcuttur.çelik kasalı ve çift asansörlüdür.</strong></span></p><p style=\"color: rgb(0, 0, 0);\"><strong><span style=\"color: rgb(51, 51, 51);background-color: rgb(255, 255, 255);\">Polat Port Residence İstanbul Bağcılar&apos;a bağlı Mahmutbey Hacıbostan Mahallesi&apos;nde yükseliyor. Polat İnşaat tarafından inşa edilen Polat Port Residence&apos;ta 82 daire yer alıyor</span></strong></p><p style=\"color: rgb(0, 0, 0);\"><strong>Polat Port Residence&apos;in kapısından içeri adım attığınızda huzurlu, güvenli ve konforlu bir yaşama da merhaba diyeceksiniz. İş yeri stresi, işin yoruculuğu, trafiğin sıkıntısı, gürültü, kalabalık gibi sizi yoran ne varsa kapıdan içeri girdiğinizde hepsi dışarıda kalacak. Şehrin ortasında ama bir o kadar uzakta hissi veren yeni yaşam alanınızda her anınız eğlenceli, keyifli, güvenli ve doğayla iç içe geçecek.</strong></p><p style=\"color: rgb(0, 0, 0);\"><strong>Zamanın her anını dolu dolu yaşayın...<br /><br />Polat Port Residence özel mimarisiyle ve her detayı düşünülerek planlanmış daireleriyle sizlere yeni bir yaşam şekli sunuyor. İçeriye adım attığınız andan itibaren yaşadığınız her anın keyfini sürebilceğiniz zengin sosyal alanlarıyla sizlere zamanı dolu dolu yaşatıyor. Son sistem teknoloji aletleriyle donatılmış, sağlıklı ve formda kalmanızı sağlayan Fitness Center... Dört mevsim yüzebilceğiniz Açık ve Kapalı Yüzme Havuzu... Aile fertleriyle veya sevdiklerinizle birlikte yapacağınız heyecanlı maçlar için Tenis Kortu... Gün boyu zinde kalmak için ihtiyacınız olan arınma ve rahatlama için Sauna... Bol skorlu maçlar oynamak için özel Basket Sahası... Günün yorğunluğunu üzerinizden atmanızı sağlayan Hamamı...</strong></p><p style=\"color: rgb(0, 0, 0);\"> </p><p style=\"color: rgb(0, 0, 0);\"><strong>AKEL EMLAK </strong></p><p style=\"color: rgb(0, 0, 0);\"><strong>Aynur Küçükel</strong></p><p style=\"color: rgb(0, 0, 0);\"><strong>0532 413 28 71</strong></p>', '41.056443644114225,28.819810152053833', 'polat-port-residence-de-kapali-mutfak-havuz-cepheli-satilik', '1');
INSERT INTO `ilanlar` VALUES ('3110', '+++++ÇINAR OLİMPİA PARK SİTESİNDE 4+1 SATILIK', '695.000 TL', 'İstanbul', 'Bağcılar', 'Fevziçakmak Mah.', 'Aynur Küçükel', '<p style=\"color: rgb(0, 0, 0);text-align: center;\"><strong><span style=\"color: rgb(255, 0, 0);\"><span><span><font size=\"4\">ÇINAR OLİMPİA NIN EN GÜZEL CEPHESİNDE YERİNİZ HAZIR...</font></span></span></span></strong></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><strong><span style=\"color: rgb(255, 0, 0);\"><span><span><font size=\"4\">AKEL EMLAK tan SATILIK HAVUZ CEPHELİ</font></span></span></span></strong></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><strong><span style=\"color: rgb(255, 0, 0);\"><span><span><font size=\"4\">ARA KAT 4+1 SATILIK</font></span></span></span></strong></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">BAĞCILAR İlçesinin merkezinde bulunan ÇINAR olimpia park sitesi</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">Metar grup güvencesi ile imal edilmiş,mimarisi ile de göz dolduran prestijli bir projedir.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">Ulaşım kolaylığı ile de tercih edilen ve bilinen tek ve komple bir projesidir.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">Dairenin tanıtımı : </font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span style=\"color: rgb(255, 0, 0);\"><span><strong><font size=\"4\">* 4+1 </font></strong></span></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*Güney cepheli</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">* Yatak odası bölümünde dolaplı mahal </font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*Detaylı bilgiler kısmındaki iç ve dış özelliklerin tümü eksiksiz mevcuttur.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*Mutfakta tüm ankastre ürünler dahildir.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*Mutfakta kiler odası mevcuttur.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*Kiler odası dolaplıdır.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*Isı izolasyonu teknik şartnameye uygun yapıldığı için kış mevsiminde ısı kaybı minimalize edilmiştir.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*Sosyal tesisleri hijyenik olup,sadece bayanlar için ayrılmış günleri vardır.Açık havuzu olimpiktir.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*Otopark sıkıntısı yoktur,asansörle garaj katına ulaşım vardır.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*Ayrıca yük asansörü olup,haricinde 2 asansör daha mevcuttur.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*Müstakil jeneratör elektirik kesintilerinde otomatik devreye girmektedir.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*ÖZENLİ bir site yönetimine ve titiz bir güvenliğe sahiptir.</font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font size=\"4\"> </font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font size=\"4\"> </font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong><font size=\"4\">*Detaylı bilgi ve dairemizi görmek için <span style=\"color: rgb(255, 0, 0);\"><span>AKEL EMLAK </span> Aynur Küçükel</span></font></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span style=\"color: rgb(255, 0, 0);\"><span><strong><font size=\"4\">                                                                            0532 413 28<span> </span></font></strong></span></span></p>', '41.04285067482171,28.853230476379395', 'cinar-olimpia-park-sitesinde-4-1-satilik', '1');
INSERT INTO `ilanlar` VALUES ('3111', 'YENİ MAHALLE METROSUNA ÇOK YAKIN site içinde kiralık 1+1 daire', '1.250 TL', 'İstanbul', 'Bağcılar', 'Yenimahalle Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><span><span style=\"color: rgb(255,0,0);\"><strong><font face=\"arial black, sans-serif\" size=\"4\">AKEL EMLAK tan</font></strong></span></span></p><p style=\"text-align: center;\"><span><strong><font face=\"arial black, sans-serif\" size=\"4\">KİRAZLI KONAKLARINDA <span style=\"color: #ff0000;\">KİRALIK 1+1</span> DAİRE</font></strong></span></p><p style=\"text-align: center;\"><b>ankastre (fırın,ocak,bulaşık makinesi)</b><br /></p><p style=\"text-align: center;\"><span><strong>Daire içi büyük,aydınlık mahallerden oluşmaktadır.</strong></span></p><p style=\"text-align: center;\"><span><strong>Arakat ve site içine bakıyor olması da büyük bir avantajdır.</strong></span></p><p style=\"text-align: center;\"><span><strong>Prestijli bir bölgede bulunan 3 bloktan oluşan sitemiz,6 dönüm arazi üzerine kurulmuştur.</strong></span></p><p style=\"text-align: center;\"><span><strong>KİRAZLI konaklar dedindiğinde çevresinde bilinen ve takip edilen bir klasmandadır.</strong></span></p><p style=\"text-align: center;\"><span><strong>Havaalanına 10 dk,<span style=\"color: rgb(255,0,0);\"><span style=\"background-color: rgb(255,255,224);\">METROYA </span></span><span style=\"background-color: rgb(255,255,224);\"> </span>yürüyerek 2 dk,Otobana 5 dk,istoça 5 dk mesafede</strong></span></p><p style=\"text-align: center;\"><span><strong>Mahmutbey caddesi üzerinde </strong></span></p><p style=\"text-align: center;\"><span><strong>Konutların ve kurumların olduğu bir bölgede</strong></span></p><p style=\"text-align: center;\"><span><strong>İRTİBAT 0532 413 28 71</strong></span></p><p> </p>', '41.0403259571,28.8363432884', 'yeni-mahalle-metrosuna-cok-yakin-site-icinde-kiralik-1-1-daire', '1');
INSERT INTO `ilanlar` VALUES ('3112', 'Esenler de KİRALIK iskanlı 620 m2 depolu dükkan', '7.500 TL', 'İstanbul', 'Esenler', 'Havaalanı Mah.', 'Aynur Küçükel', '<p> </p><p><span><span><span style=\"color: #ff0000;\"><strong><span style=\"background-color: #ffa07a;\">AKEL EMLAK tan                                                       </span></strong></span></span></span></p><p><u><span><strong>İSKANLI ÇİFT CEPHELİ                                                                                                    </strong></span></u></p><p><u><span><strong>ZEMİN KAT ve YANINA ARABA YANAŞIR AYDINLIK </strong></span></u><u><strong>BODRUM KATTAN OLUŞUR.</strong></u></p><p><span><b><u><font face=\"arial black, sans-serif\" color=\"#ff0000\">BODRUM KAT ÖNÜNE ARABA YANAŞIR ve mal sevkiyatı için çok uygundur.</font></u></b></span></p><p><span><b><u>MARKET-MOBİLYA MAĞAZASI-ANAOKULU-ŞİRKET MERKEZİ-KURS-SÜRÜCÜ KURSU-KLİNİK-İMALAT GİBİ ÇOK AMAÇLI İŞLER İÇİN UYGUNDUR.</u></b></span></p><p><span><b><u><font color=\"#ff0000\" face=\"arial black, sans-serif\">ARKA BAHÇE GENİŞLETMEYE MÜSAİT OLDUĞUNDAN ANAOKULU KULLANIMINA UYGUN HALE GELEBİLİR.</font></u></b></span></p><p><span><b><u>YENİ YAPILAN SİTE PROJESİNİN  (100 DAİRELİK) HEMEN ALT KISMINDADIR.</u></b></span></p><p><span><b><u><br /></u></b></span></p><p><span><strong>*Esenler emniyet müdürlüğüne çok yakın ,otogar- sebze hali-tekstilkent ve giyimkente 5 dk mesafede.</strong></span></p><p><span><strong>*Tem ve E6 bağlantı yollarına hemen ulaşım.</strong></span></p><p> </p><p><br /></p><p> </p><p><span><span style=\"color: #ff0000;\"><span><strong><em><span style=\"background-color: #ffa07a;\">Gayrimenkul ve yatırım danışmanınız  AYNUR KÜÇÜKEL                                                      </span></em></strong></span></span></span></p><p><span><span style=\"color: #ff0000;\"><span><strong><span style=\"background-color: #ffa07a;\">                                                                0532 413 28 71                                                       </span></strong></span></span></span></p>', '41.0569290554,28.868830204', 'esenler-de-kiralik-iskanli-620-m2-depolu-dukkan', '1');
INSERT INTO `ilanlar` VALUES ('3113', 'İNÖNÜ MH ÇOK GENİŞ İSKANLI 110 M2 SATILIK 2+1 DAİRE', '260.000 TL', 'İstanbul', 'Küçükçekmece', 'İnönü Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\" color=\"#ff0000\" style=\"background-color: rgb(255, 240, 245);\">AKEL EMLAK TAN </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">ÇOK İYİ LOKASYON ÇOK UYGUN FİYAT VE ÇOK GELİŞME KAYDEDEN BİR BÖLGEDEDİR</font></p><p style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);float: none;background-color: rgb(255, 255, 255);\"><font face=\"arial black, sans-serif\" size=\"4\">DAİREMİZ GÖREBİLECEĞİNİZ BÜYÜK ve KULLANIŞLI  2+1 MİMARİYE SAHİPTİR.</font></span></p><p style=\"text-align: center;\"><span style=\"color: rgb(0, 0, 0);float: none;background-color: rgb(255, 255, 255);\"><font face=\"arial black, sans-serif\" size=\"4\">BÜYÜK AYDINLIK BİR MUTFAK VE BANYOSU VARDIR.</font></span></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">İNÖNÜ MAHALLESİNDE YAŞA EVLER SİTESİ YANINDA ,MUAMMER AKSOY CD ÇOK YAKIN KONUMLU</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">KREDİYE UYGUN İSKANLI BİNADA </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">1 KATTA BULUNAN DAİREMİZ SATILIKTIR.</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">ARSASI BÜYÜK OLDUĞUNDAN KULLANIŞLI OTOPARKI VARDIR.</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">ETRAFI ÇEVRİLİ ve İÇİNDE ÇOÇUKLAR İÇİN EĞLENCE ALANI MEVCUTTUR.<br /></font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\" color=\"#ff0000\" style=\"background-color: rgb(255, 240, 245);\">İLETİŞİM 0532 413 2871 </font></p><p style=\"text-align: center;\"><br /></p>', '41.018177043105126,28.803786635398865', 'i