INSERT INTO `ilanlar` VALUES ('3114', 'GÜNEŞLİ DE SATILIK ÇOK BÜYÜK 3+1 DAİRE ÇOK UYGUN FİYATA SATILIK', '355.000 TL', 'İstanbul', 'Bağcılar', 'Güneşli Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">AKEL EMLAK TAN</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\" color=\"#ff0000\">BU DAİREMİZİ GÖRMEDEN,DAİRE ALMAKTAKİ KARARINIZI HEMEN VERMEYİN ...</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">GÜNEŞLİ EVREN CD KESEN SOKAKTA </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">CADDEYE YAKIN KONUMLU SOKAK BAŞI </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">ÇOK BÜYÜK 3+1 DAİRE SATILIKTIR.</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">2 BALKONLU ,BANYO WC AYRI </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">AYDINLIK GÜNEY CEPHEDİR.</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">0532 413 28 71</font></p>', '41.035509152038344,28.825174570083618', 'gunesli-de-satilik-cok-buyuk-3-1-daire-cok-uygun-fiyata-satilik', '1');
INSERT INTO `ilanlar` VALUES ('3115', 'GÜNEŞLİ MEYDANA ÇOK YAKIN 200 M2 ÇOK 6+1 GENİŞ DUBLEKS DAİRE', '435.000 TL', 'İstanbul', 'Bağcılar', 'Bağlar Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><font size=\"3\" face=\"arial black, sans-serif\"><font color=\"#ff0000\">AKEL</font> EMLAK TAN</font></p><p style=\"text-align: center;\"><font size=\"3\" face=\"arial black, sans-serif\" style=\"background-color: rgb(64, 224, 208);\">ÇOK UYGUN FİYATLI KAÇIRILMAZ SIFIR DUBLEKS DAİRE</font></p><p style=\"text-align: center;\"><font size=\"3\" face=\"arial black, sans-serif\" color=\"#ff0000\">GÜNEŞLİ MEYDANA ÇOK YAKIN MESAFEDE,</font></p><p style=\"text-align: center;\"><font size=\"3\" face=\"arial black, sans-serif\">GÜNEY CEPHELİ SON DERECE AYDINLIK ve ÇOK GENİŞ ODALARA SAHİP DUBLEKS DAİREMİZ SATILIKTIR.</font></p><p style=\"text-align: center;\"><font size=\"3\" face=\"arial black, sans-serif\">ALT KAT 3+1 DAİRE OLUP BALKON+BANYO+WC MEVCUTTUR.</font></p><p style=\"text-align: center;\"><font size=\"3\" face=\"arial black, sans-serif\">ÜST KAT 2+1 DAİRE OLUP BANYO VE TERAS MEVCUTTUR.</font></p><p style=\"text-align: center;\"><font size=\"3\" face=\"arial black, sans-serif\">ASANSÖRLÜ </font></p><p style=\"text-align: center;\"><font size=\"3\" face=\"arial black, sans-serif\">İSKANLI</font></p><p style=\"text-align: center;\"><font size=\"3\" face=\"arial black, sans-serif\">0532 413 28 71</font></p><p style=\"text-align: center;\"><font size=\"3\" face=\"arial black, sans-serif\">Aynur Küçükel</font></p><p><br /></p>', '41.03117127286479,28.825217485427856', 'gunesli-meydana-cok-yakin-200-m2-cok-6-1-genis-dubleks-daire', '1');
INSERT INTO `ilanlar` VALUES ('3116', 'NATURE PARK GÜNEŞLİ DE SON 3+1 SATILIK DAİRE', '535.000 TL', 'İstanbul', 'Bağcılar', 'Güneşli Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"5\"><span style=\"background-color: rgb(255, 0, 0);\"><font color=\"#ffffff\">AKEL </font></span><span style=\"background-color: rgb(255, 255, 255);\"><font color=\"#ff0000\">EMLAK TAN</font></span></font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">NATURE PARK GÜNEŞLİ PROJESİNDEN SON İKİ DAİRE</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" color=\"#ff0000\"><br /></font></p><p><font face=\"arial black, sans-serif\" color=\"#ff0000\">TÜM DAİRELERİN DOLU OLDUĞU PROJEDE İSKAN ALINMIŞ OLUP,DAİRELERİMİZ GÜNEYBATI CEPHELİDİR.</font></p><ul><li><font face=\"arial black, sans-serif\">DAİREMİZ SALON VE 3 YATAK ODASINDAN OLUŞUYOR,</font></li><li><font face=\"arial black, sans-serif\">YATAK ODASINDA EBEVEYN BANYOSU,</font></li><li><font face=\"arial black, sans-serif\">ANA BANYO ve WC </font></li><li><font face=\"arial black, sans-serif\">MUTFAK ANKASTRELİ</font></li><li><font face=\"arial black, sans-serif\">KULLANIŞLI İKİ BALKON</font></li><li><font face=\"arial black, sans-serif\">ESTETİK GÖRÜNÜME ÖNEM VERİLDİĞİNDEN MİMARİ TASARIMI İLE FARK YARATMAKTADIR.</font></li></ul><p><font face=\"arial black, sans-serif\"><br /></font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\">YILMAZ GRUP İNŞAAT GÜVENCESİYLE YAPILAN PROJE,BAĞCILAR BELEDİYE BİNASININ HEMEN KARŞISINDA OLUP MAHMUTBEY CADDESİNE CEPHE,TOPLU TAŞIMA ARAÇLARINA ÇOK YAKIN MESAFEDEDİR.<br /></font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\">HAVAALANINA 10 DK MESAFEDE ,KAMU KURUMLARINA İSE 5 DK YÜRÜME MESAFESİNDEDİR.</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\">GÜNEŞLİ MEYDANA YÜRÜME MESAFESİNDE OLUP,1700 M2 ARSA ÜZERİ