INSERT INTO `ilanlar` VALUES ('3117', '++++ AKEL den ÇINAR OLİMPİA PARK TAM HAVUZ MANZARALI 3+1 DAİRE', '540.000 TL', 'İstanbul', 'Bağcılar', 'Fevziçakmak Mah.', 'Aynur Küçükel', '<p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><span style=\"color: rgb(0, 0, 255);\"><strong><font face=\"arial black, sans-serif\" size=\"5\">İKİ SİTENİN DE HAVUZUNU TAM GÖREN MANZARALI</font></strong></span></span></p><p style=\"text-align: center;\"><strong><font face=\"arial black, sans-serif\" size=\"5\" style=\"background-color: rgb(238, 130, 238);\" color=\"#fff0f5\">RESİMLER ORJİNALİNDEKİ GİBİDİR.</font></strong></p><p style=\"text-align: center;\"><strong><font face=\"arial black, sans-serif\" size=\"5\" style=\"background-color: rgb(238, 130, 238);\" color=\"#fff0f5\">İLETİŞİM : 0532 413 2871</font></strong></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><span><span style=\"color: rgb(255, 0, 0);\"><strong><font face=\"arial black, sans-serif\" size=\"4\">2.etapta </font></strong></span></span></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><span><strong>* SATILIK 3+1 daire</strong></span></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><span><strong>METRO,TRANVAY(10 dk yürüme)OTOBÜS ve minibüs durakları(2 dk yürüme) ulaşımı ağına rahat erişim</strong></span></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><span><span style=\"color: rgb(255, 0, 0);\"><strong>BAĞCILAR İlçesinin merkezinde bulunan ÇINAR olimpia park sitesi</strong></span></span></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><span><span style=\"color: rgb(255, 0, 0);\"><strong>Metar grup güvencesi ile imal edilmiş,mimarisi ile de göz dolduran prestijli bir projedir.</strong></span></span></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><span><span style=\"color: rgb(255, 0, 0);\"><strong>Ulaşım kolaylığı ile de tercih edilen,tek ve komple bir site projesidir.</strong></span></span></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"> </p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span style=\"color: rgb(0, 0, 255);\"><span><span><strong>* sitedeki yaşam için oradaki daire sahiplerimiz referanslarımızdır.</strong></span></span></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"> </p><p style=\"color: rgb(0, 0, 0);text-align: center;\"> </p><p style=\"color: rgb(0, 0, 0);text-align: center;\"> </p><table style=\"color: rgb(0, 0, 0);width: 710px;\"><tbody><tr><td style=\"height: 197px;width: 355px;\"><p style=\"text-align: center;\"><span><span><strong><font face=\"arial black, sans-serif\" size=\"3\">* kira getirisi :1750 tl&apos;dir.</font></strong></span></span></p><p style=\"text-align: center;\"><span><span><span style=\"color: rgb(255, 0, 0);\"><strong>BAĞCILAR MERKEZDE 3 BLOKTAN OLUŞAN SİTE İÇERİSİNDE SÜPER LÜKS DARİRELER. 7/24 GÜVENLİK, AÇIK - KAPALI YÜZME HAVUZU, ÇOCUK HAVUZU, SPOR TESİSLERİ, TENİS KORTU, SAUNA, FITNES GİBİ BİRÇOK SOSYAL İMKANLARI OLAN MUHTEŞEM BİR SİTE...</strong></span></span></span></p></td><td style=\"height: 197px;width: 355px;\"><p style=\"text-align: center;\"> </p><p style=\"text-align: center;\"><span><span><span style=\"color: rgb(255, 0, 0);\"><strong>GENİŞ, FERAH KULLANIŞLI BİR DAİRE, ÇİFT ASANSÖR, ARTI YÜK ASANSÖRÜ, ANKASTRE MUTFAK ÜRÜNLERİ EVEVEYN BANYOLU, MUTFAKTA KİLER ODASI,DAİRE OTOMATİK JENERATÖRÜ,</strong></span></span></span></p></td></tr><tr><td style=\"height: 115px;width: 709px;\"><p style=\"text-align: center;\"><span><span><span style=\"color: rgb(255, 0, 0);\"><strong>         DETAYLI BİLGİ İÇİN RANDEVU ALINIZ</strong></span></span></span><br /> </p><p style=\"text-align: center;\"><span><span><strong>            AKEL EMLAK  </strong></span></span><strong>AYNUR KÜÇÜKEL             Tel : 0532 413 28 71</strong></p></td></tr></tbody></table>', '41.04436485211596,28.852715492248535', 'akel-den-cinar-olimpia-park-tam-havuz-manzarali-3-1-daire', '1');
