INSERT INTO `ilanlar` VALUES ('3130', 'GÜNEŞLİNİN EN GÜZEL YERİNDE SATILIK 3+1 140+77 M2 TERASLI DAİRE', '550.000 TL', 'İstanbul', 'Bağcılar', 'Güneşli Mah.', 'Erdal Koruk', '<p>AKEL EMLAK&apos;TAN</p><p>GÜNEŞLİNİN EN GÜZEL YERİNDE EVREN CADDESİNE CEPHE OKULA MARKETE BELEDİYEYE MEYDANA YÜRÜME MESAFESİNE</p><p>1650 M2 ARSA ÜZERİNE İNŞA EDİLMİS BİNADA TOPLAM 16 ADET DAİRE VARDIR DAİREMİZE AİT TOPLAM 3 ADET OTOPARK YERİ VARDIR (KAPALI VE AÇIK)</p><p>BİNE GİRİŞ ÇIKIŞ VE OTOPARK ALANLARI GÜVENLİK KAMERASI İLE 7/24 KAYIT ALTINDA TUTULMAKTADIR</p><p>DAİRENİN KENDİNE AİT 77 M2 TERAS ALANI VARDIR </p><p>İSKANLI VE KAT İRTİFAKLIDIR ORTAK KULLANIM ALANLARI OLARAK 200 M2 TOPLANTI ODASI MEVCUTTUR</p><p>SULARINIZ KESİLMEZ 3 TONLUK SU DEPOSU </p><p>ORTAK DAHİLİ ADSL </p><p>ISI İZOLASYON </p><p>SES İZOLASYON</p><p>1. SINIF İNŞAAT KALİTESİ</p><p>1. DERECE DEPREM YÖNETMELİĞİNE UYGUN İNŞAAT</p><p>DAHA DETAYLI BİLGİ İÇİN İRTİBATA GEÇİNİZ</p><p>GAYRİMENKUL YATIRIM DANIŞMANI </p><p>ERDAL KORUK 0533 453 83 43</p><p><br /></p>', '41.03393913175997,28.826504945755005', 'guneslinin-en-guzel-yerinde-satilik-3-1-140-77-m2-terasli-daire', '1');
INSERT INTO `ilanlar` VALUES ('3131', 'GÜNEŞLİ MEYDAN&#039;DA KİRALIK 3+1 KAPALI AÇIK OTOPARKLI DAİRE', '1.650 TL', 'İstanbul', 'Bağcılar', 'Güneşli Mah.', 'Erdal Koruk', '<p>DAİREMİZ GÜNEŞLİNİN ENGÜZEL LOKASYONUNDADIR</p><p>1650 M2 ARSA ÜZERİNE KURULU AÇIK KAPALI OTOPARKLI HER DAİRE İÇİN 2 ARAÇLIK OTOPARK</p><p>GÜVENLİK KAMERALI</p><p>ANA CADDE CEPHELİ</p><p>KENDİNE MÜNHASIR 77 M2 TERAS </p><p>TOPLU TAŞIMA ARAÇLARINA MARKET PAZAR OKUL GİBİ İHTİYAÇLARA CEVAP VERECEK POZİSYONDA</p><p>KİRALAMA ŞARTLARI </p><p>2 KİRA DEPOZİT 1 KİRA PEŞİN + YILLIK KİRANIN % 12 HİZMET BEDELİ VARDIR</p><p>İLETİŞİM </p><p>ERDAL KORUK 0533 453 83 43</p>', '41.0339876896493,28.826483488082886', 'gunesli-meydan-039-da-kiralik-3-1-kapali-acik-otoparkli-daire', '1');
INSERT INTO `ilanlar` VALUES ('3132', 'AKEL EMLAK&#039;TAN ÇINAR OLİMPİA PARK&#039;TA TAM HAVUZ CEPHE KİRALIK 3+1', '2.000 TL', 'İstanbul', 'Bağcılar', 'Fevziçakmak Mah.', 'Erdal Koruk', '<p><b><span style=\"color: black;\">                                                      \n  GAYRİMENKULÜN TANIMI</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">METAR İNŞAAT GÜVENCESİYLE İNŞA EDİLEN\nMUHTEŞEM MİMARİYE SAHİP 3+1 EVEBEYN BANYOLU </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">ÖZEL GÜVENLİK DUVARIYLA ÇEVRİLİ BU SİTEDE\n7/24 SİTE İÇİ GÜVENLİK BİRİMLERİNLE KONTROL EDİLMEKTEDİR</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">KAPALI AÇIK YÜZME HAVUZU (ÇOCUK YÜZME HAVUZU) </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">DAİRE İÇİ JAKUZİ</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">MUTFAKTA KİLER</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">TENİS KORTU </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">FUTBOL SAHASI</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">KAPALI AÇIK OTOPARK</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">ÇOCUK OYUN ALANI</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">DİNLENME ALANLAR</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">SAUNA </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">SPOR SALONU</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">HER BLOKTA 1 ADET YÜK ASANSÖRÜ OLMAK ÜZERE\nTOPLAMDA 3 ADET ASANSÖR VARDIR</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">GENİŞ VE KULLANIŞLI SALONU GENİŞ BANYOLARI\nOLAN RAHAT BİR YAŞAM İÇİN TASARLANMIŞ MİMARİYE SAHİPTİR</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">ARAÇLARIN GİREMEDİĞİ,ÇOCUKLARIN RAHATÇA\nOYNAYABİLCEĞİ OYUN ALANLARI VE AİLENİZİN HUZUR VE GÜVEN\nİÇİNDE YAŞAYABİLCEĞİ BİR ORTAM</span></b><b>.</b></p><p><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">İLK OKUL LİSE ECZANE SEMT PAZARI CAMİ\nMARKET YÜRÜME MESAFESİNDEDİR </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">TOPLU TAŞIMA GÜZARGAHI ÜZERİNDEDİR </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">ULAŞIM BAKIMINDA TEM OTOYOLU VE E5 GİBİ\nANA ULAŞIM YOLLARINA KOLAY ULAŞIM KONUMUNDADIR.</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Portföyümde\nyer alan bu gayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek\nyerinde görmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim\nbilgilerinden tarafıma ulaşabilirsiniz.</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Saygılarımla</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Erdal\nKORUK 0533 453 83 43</span></b><span style=\"color: black;\"></span></p><p style=\"text-align: justify;\"><b><span style=\"color: black;\">Gayrimenkül\nYatırım Danışmanı</span></b><span style=\"color: black;\"></span></p>', '41.042700974706484,28.853659629821777', 'akel-emlak-039-tan-cinar-olimpia-park-039-ta-tam-havuz-cephe-kiralik-3-1', '1');
INSERT INTO `ilanlar` VALUES ('3133', 'AKEL EMLAK&#039;TAN KAÇMAZ FIRSAT ACİL SATILIK 3+1 SİTE İÇİ DAİRE', '320.000 TL', 'İstanbul', 'Bahçelievler', 'Yenibosna Merkez Mah.', 'Erdal Koruk', '<p><b>DAİREMİZ 130 M2 3+1 SİTE İÇERİSİNDE OLUP GÜNEY CEPHE DİR BAHÇELİEVLER&apos;İN İLK ELİT SİTESİDİR !!!</b></p><p><b>BASIN EKSPRES YOLU HAVALİMANI E 5 TEM OTOYOLUNA 5 DK MESAFEDEDİR İHTİYAÇTAN SATILIKTIR </b></p><p><b>BÖLGE OLARAK SÜREKLİ DEĞER KAZANAN ETRAFINDA YENİ PROJELERİN YÜKSELDİĞİ VE BU PROJELERDEKİ 3+1 EMSAL M2 DEKİ DAİRE FİYATLARININ 750 000.00 TL DEN BAŞLADIĞINI İHTİYAÇ OLMASA SATILMAYACAK KONUMDA OLDUĞUNU BELİRTMEK İSTERİZ</b></p><p><b>SİTE İÇİNDEKİ DAİREMİZ HEMEN KARŞISINDA SUR YAPI CORRİDOR PROJESİ (TAMAMLANMIŞ) HEMEN ALTINDA BAHÇELİEVLER MİMAR SİNAN PARKI ONUN ALT TARAFINDA VE GÜNEŞLİ PROJESİ YER ALMAKTADIR</b></p><p><b>YENİ TEMELİ ATILAN BAKIRKÖY BAHÇELİEVLER METRO HATTINA ÜZERİNDE BULUNAN DAİREMİZ GELECEĞİN EN MANTIKLI YATIRIMI OLACAKTIR</b></p><p><b>DAİREMİZİ GÖRMEDEN DAİRE ALMAYA KARAR VERMEYİNİZ </b></p><p><font color=\"#ff0000\"><b>ERDAL KORUK 0533 453 83 43</b></font></p><p><font color=\"#ff0000\"><b>AKEL EMLAK GAYRİMENKUL YATIRIM DANIŞMANI</b></font></p><p><br /></p><p><br /></p>', '41.019515158050275,28.822875916957855', 'akel-emlak-039-tan-kacmaz-firsat-acil-satilik-3-1-site-ici-daire', '1');
INSERT INTO `ilanlar` VALUES ('3134', 'Mahmutbey metrosuna çok yakın konumlu ÇOK ACİL SATILIK 3+1 DAİRE', '520.000 TL', 'İstanbul', 'Bağcılar', 'Mahmutbey Mah.', 'Aynur Küçükel', '<p>AKEL EMLAK TAN <br />\nMAHMUTBEY METRO İSTASYONUNA ÇOK YAKIN KONUMLU OTURUMA HAZIR SİTE İÇERİSİNDE <br />\nACİLLL SATILIK EBEVEYN BANYOLU SIFIR 3+1 DAİRE <br />\nSİTEDE TÜM SOSYAL ETKİNLİKLER MEVCUTTUR <br />\nAÇIK KAPALI YÜZME HAVUZU FİTNESS HAMAM SAUNA OYUN PARKI KAPALI KATLI OTOPARK<br />\nDAİREMİZ 10 KATTA OLUP GÜNEY CEPHELİLER. <br />\nİLETİŞİM 0532 413 2871<br />\n</p>', '41.05273366919973,28.829870782792568', 'mahmutbey-metrosuna-cok-yakin-konumlu-cok-acil-satilik-3-1-daire', '1');
INSERT INTO `ilanlar` VALUES ('3135', 'YENİ MAHELLE MEKAN SİTESİNDE SATILIK 160 M2 3+1 DAİRE', '515.000 TL', 'İstanbul', 'Bağcılar', 'Yenimahalle Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">AKEL EMLAK TAN</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\" color=\"#ff0000\">YENİ MAHALLE METRO DURAĞI TAM KARŞISINDA</font></p><p style=\"text-align: center;\"><font color=\"#ff0000\" face=\"arial black, sans-serif\" size=\"4\">DAİREMİZİN NETİ 125 M2 </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">BÜYÜK VE AYDINLIK ODALARA SAHİP </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">EBEVEYN BANYOLU,WC Lİ , KİLER ODALI,ANA BANYOLU</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">BALKONLU</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">GÜNEY DOĞU CEPHELİ </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">SİTE İÇİNDE </font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">OTOPARKLI , PEYZAJLI , GÜVENLİKLİ SİTEDE</font></p><p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"4\">İLETİŞİM : 0532 413 28 71 AYNUR KÜÇÜKEL</font></p><p style=\"text-align: center;\"><br /></p><p><br /></p>', '41.04108661939619,28.836203813552856', 'yeni-mahelle-mekan-sitesinde-satilik-160-m2-3-1-daire', '1');
INSERT INTO `ilanlar` VALUES ('3136', 'ÇINAR OLİMPİA PARKTA KİRALIK 3+1', '2.200 TL', 'İstanbul', 'Bağcılar', 'Fevziçakmak Mah.', 'Erdal Koruk', '<p style=\"text-align: left;\"><b><span style=\"color: black;\">                                                                   GAYRİMENKULÜN TANIMI</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">METAR İNŞAAT GÜVENCESİYLE İNŞA EDİLEN\nMUHTEŞEM MİMARİYE SAHİP 3+1 EVEBEYN BANYOLU </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">ÖZEL GÜVENLİK DUVARIYLA ÇEVRİLİ BU SİTEDE\n7/24 SİTE İÇİ GÜVENLİK BİRİMLERİNLE KONTROL EDİLMEKTEDİR</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;background-color: rgb(255, 0, 0);\">DAİRE TAM HAVUZ CEPHELİDİR</span></b></p><p><b><span style=\"color: black;\">KAPALI AÇIK YÜZME HAVUZU </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">DAİRE İÇİ JAKUZİ</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">MUTFAKTA KİLER</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">TENİS KORTU </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">FUTBOL SAHASI</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">KAPALI AÇIK OTOPARK</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">ÇOCUK OYUN ALANI</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">DİNLENME ALANLAR</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">SAUNA </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">SPOR SALONU</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">HER BLOKTA 1 ADET YÜK ASANSÖRÜ OLMAK ÜZERE\nTOPLAMDA 3 ADET ASANSÖR VARDIR</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">GENİŞ VE KULLANIŞLI SALONU GENİŞ BANYOLARI\nOLAN RAHAT BİR YAŞAM İÇİN TASARLANMIŞ MİMARİYE SAHİPTİR</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">ARAÇLARIN GİREMEDİĞİ,ÇOCUKLARIN RAHATÇA\nOYNAYABİLCEĞİ OYUN ALANLARI VE AİLENİZİN HUZUR VE GÜVEN\nİÇİNDE YAŞAYABİLCEĞİ BİR ORTAM</span></b><b>.</b></p><p><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">İLK OKUL LİSE ECZANE SEMT PAZARI CAMİ\nMARKET YÜRÜME MESAFESİNDEDİR </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">TOPLU TAŞIMA GÜZARGAHI ÜZERİNDEDİR </span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">ULAŞIM BAKIMINDA TEM OTOYOLU VE E5 GİBİ\nANA ULAŞIM YOLLARINA KOLAY ULAŞIM KONUMUNDADIR.</span></b><span style=\"color: black;\"></span></p><p><b><span style=\"color: black;\">İKİ KİRA DEPOZİT </span></b></p><p><b><span style=\"color: black;\">BİR KİRA PEŞİN </span></b></p><p><b><span style=\"color: black;\">HİZMET BEDELİ YILLIK KİRANIN %12</span></b></p><p style=\"text-align: justify;\"><b><font color=\"#ff0000\">Portföyümde\nyer alan bu gayrimenkulün adres bilgilerini öğrenmek daha detaylı bilgi edinmek\nyerinde görmek veya tanıtım, sunum amacıyla randevu almak için aşağıdaki erişim\nbilgilerinden tarafıma ulaşabilirsiniz.</font></b></p><p style=\"text-align: justify;\"><b><font color=\"#ff0000\">Saygılarımla</font></b></p><p style=\"text-align: justify;\"><b><font color=\"#ff0000\">Erdal\nKORUK 0533 453 83 43</font></b></p><p style=\"text-align: justify;\"><b><font color=\"#ff0000\">Gayrimenkül\nYatırım Danışmanı</font></b><span style=\"color: black;\"></span></p>', '41.04261702111447,28.853144645690918', 'cinar-olimpia-parkta-kiralik-3-1', '1');
INSERT INTO `ilanlar` VALUES ('3137', 'MAHMUTBEY METROYA ÇOK YAKIN HAVUZLU GÜVENLİKLİ SİTE İÇİ 3+1', '530.000 TL', 'İstanbul', 'Bağcılar', 'Göztepe Mah.', 'Erdal Koruk', '<p>ÖZELLİKLER</p><p>8500 M2 ALAN ÜZERİNE KURULU DEPREM YÖNETMELİĞİNE UYGUN</p><p>ADALAR MANZARALI</p><p>YÜRÜYÜŞ YOLLARI KAMELYA DİNLENME ALANLARI</p><p>BİSİKLET PARKURLARI</p><p>METRO İSTASYONUNA 2 DK</p><p>TEM OTOYOLUNA 1DK</p><p>ÇOCUK OYUN ALANI</p><p><span>3+1 EBEVEYN BANYOLU</span><br /></p><p>BALKONLU</p><p>ISI YALITIM </p><p>SES YALITIM </p><p>YÜZME HAVUZU</p><p>7/24 GÜVENLİK</p><p>HER  BLOKTA ÇİFT ASANSÖR</p><p>KISACASI AİLENİZİ GÜVENLİ VE KALİTELİ YAŞAM İLE TANIŞTIRMANIZIN TAM VAKTİ</p><p>DETAYLAR İÇİN ARAYINIZ</p><p>ERDAL KORUK 0533 453 83 43</p><p><br /></p>', '41.05687697495454,28.83402585983276', 'mahmutbey-metroya-cok-yakin-havuzlu-guvenlikli-site-ici-3-1', '1');
