INSERT INTO `ilanlar` VALUES ('3143', 'Güneşli park gardenya evlerinde FULL EŞYALI 2+1 KİRALIK DAİRE', '2.800 TL', 'İstanbul', 'Bağcılar', 'Bağlar Mah.', 'Aynur Küçükel', '<p style=\"color: rgb(0, 0, 0);\"><strong style=\"text-align: center;\"><strong><font size=\"5\"><font color=\"#fff0f5\"><span style=\"background-color: rgb(255, 0, 0);\"><span> </span>                                 AKEL EMLAK </span></font><font color=\"#ff0000\"><span style=\"background-color: rgb(255, 0, 0);\">tan nmnmnmnmnmmmnmnmnmn          <span> </span></span></font></font></strong></strong><strong style=\"text-align: center;\"><strong><font size=\"5\"><font color=\"#ff0000\"> </font></font></strong></strong><br /></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font size=\"6\"><b>GÜNEŞLİ PARK GARDENYA EVLERİNDE </b></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font size=\"6\"><b>EKSİKSİZ TAM EŞYALI KİRALIK DAİRE</b></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font size=\"6\"><b>fotoğraflarımız daireden çekilmiş gerçek görsellerdir.</b></font></p><p style=\"text-align: center;\"><font color=\"#ff0000\" size=\"5\"><b>Havaalanına 10 dk basın ekspress yoluna 5 dk,güneşli meydana 5 dk </b></font></p><p style=\"text-align: center;\"><font color=\"#ff0000\" size=\"5\"><b><span style=\"color: rgb(0, 0, 0);float: none;background-color: rgb(255, 255, 255);\">Güvenlikli Site içerisinde, Sauna, Hamam, Buhar Odası, Fitness merkezi, Kapalı ve açık yüzme havuzu, Kapalı otopark (</span><span style=\"color: rgb(0, 0, 0);float: none;background-color: rgb(255, 255, 255);\">asansör otoparka kadar inmektedir<span> )</span></span><span style=\"color: rgb(0, 0, 0);float: none;background-color: rgb(255, 255, 255);\">,</span><span style=\"color: rgb(0, 0, 0);float: none;background-color: rgb(255, 255, 255);\">çocuk parkı, basket sahası.</span><span style=\"color: rgb(0, 0, 0);float: none;background-color: rgb(255, 255, 255);\"><span> </span>Güvenle ve huzurla yaşanabilecek bir aile sitesidir. 127 m2 brüt, 98 m2 net kullanım alanı vardır. </span></b></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font size=\"5\"><b><br /></b></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font face=\"arial black, sans-serif\" size=\"3\"><span style=\"color: rgb(0, 0, 0);float: none;background-color: rgb(255, 255, 255);\">Gün ışığından olabildiğince yararlanmak için tasarlanan ferah bir mimari tasarımı vardır. Toplam inşaat alanı 20.900 m2 olan projede, 17.200m2 yeşil alana sahiptir. Basın ekspres yoluna 212 avm, starcity alışveriş merkezlerine birkaç dakika mesafede merkezi bir yerdedir. Site deprem yönetmeliğine uygun olarak yapılmıştır ve radye temel perde betonludur. Binaların dış cephesi mantolama olup ısı ve ses yalıtımı sağlanmıştır. Yangın merdiveni ve yangın alarmı vardır. Salonda klima, yatak odasında ebeveyn banyosu, antrede ise gömme dolap ve vestiyer mevcuttur. Mutfaklar ankastre mutfak olup fırın, ocak ve davlumbaz takılıdır.</span><br /></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><br /></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><b>Daha detaylı bilgi için arayız</b><br /></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><b>0532 413 28 71 Aynur Küçükel</b><br /></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><font color=\"#ff0000\" size=\"5\"><span><b><strong style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><strong><font size=\"5\"><font color=\"#fff0f5\"><span style=\"background-color: rgb(255, 0, 0);\">                                             AKEL EMLAK </span></font><font color=\"#ff0000\"><span style=\"background-color: rgb(255, 0, 0);\">tan nmnmnmnmnmmmnmnmnmn</span></font></font></strong></strong><strong style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><strong><font size=\"5\"><font color=\"#ff0000\"> </font></font></strong></strong></b></span></font></p>', '41.02438871736988,28.825775384902954', 'gunesli-park-gardenya-evlerinde-full-esyali-2-1-kiralik-daire', '1');
INSERT INTO `ilanlar` VALUES ('3144', 'HARMONYPARK&#039;TA SİTE İÇİ SATILIK 2+1 SIFIR EBEVEYN BANYOLU DAİRE', '360.000 TL', 'İstanbul', 'Bağcılar', 'Kemalpaşa Mah.', 'Erdal Koruk', '<p style=\"color: rgb(0, 0, 0);text-align: center;\"><font color=\"#ff0000\" size=\"6\"><b>Akel emlak’tan harmonypark&apos;ta kaçmaz fırsat !!!</b></font></p><p><b><font face=\"arial black, sans-serif\">MUHTEŞEM İSTANBUL PANORAMASI BU DAİREDE </font></b></p><p style=\"color: rgb(0, 0, 0);\"><b><font face=\"arial black, sans-serif\">Sitemiz, bağcılar meydana, bağcılar tramvay hattına, bağcılar metro hattına 4 dk. Mesafededir.</font></b></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Medipol hastanesine 3 dk.</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">İstoç merkeze 5 dk.</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Mahmutbey metrosuna 5 dk.</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Tem otoyoluna 1 dk.</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Otogara 10 dk.</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Bağcılar devlet hastanesine 7 dk.</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Havalimanına 20 dk.</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Mesafede merkezi bir konumdadır. Sitemiz toplam 7370 m2 inşaat  alanına sahip, 4 bloktan oluşmaktadır.  Modern yaşamın tüm ihtiyaçlarını göz önüne alındığı projede ortak kullanıma açık alanlar</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Sosyal tesisler, açık  yüzme havuzu, sauna ve fitness center</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Açık spor alanları, voleybol, basketbol, tenis sahaları, 24 saat güvenlik</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Ev sahiplerine keyifli ve pratik bir yaşam sunma amacıyla düşünülmüş ayrıca çocuklar için oyun alanları,</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">hem büyüklerin hemde küçüklerin çeşitli aktivitelerde bulunabilecekleri rekreasyon alanları</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Sığınak ve bisiklet odaları</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Sağlıklı bir gelecek için her ayrıntıyı sizin yerinize düşünüyor</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Dijital adresli yangın algılama ve ihbar sistemi</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Bina ve daire içleri, gaz ve yangın dedektörleri</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Dijital tabanlı intercom ve fiber internet sistemi</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Çöp toplama odaları</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Her blokta 2 adet asansör</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Yangın merdivenleri</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Jeneratör</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Kameralı görüntülü dia fon sistemi bulunmaktadır</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">4055 m2 yeşil alana sahip olan  projede keyifli ve huzurlu bir yaşam sunulmaktadır. proje içerisinde 2+1, 3+1  daire seçenekleriyle farklı katlarda farklı yaşam tarzlarına sesleniyor.</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Bina deprem yönetmeliğine uygun olarak yapılmıştır ve radyan temel perde betonludur</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Binanın dış cephesi mantolama olup ısı ve ses yalıtımı sağlanmıştır.</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Bina modern mimariye sahip olup Fransız balkonludur.</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Dairenin salonunda balkon</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Yatak odasında ebeveyn banyosu</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Antrede ise vestiyeri bulunmaktadır</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Daire ısıtma sistemi merkezi sistem pay ölçerli</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">PVC ısıcamlı</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Saten boyalı</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Kartonpiyerli</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Salon ve odalar laminant parkeli</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Çelik kapılı, iç kapılar özel lake panel kapılı</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">laminant mutfaklı</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Hilton banyolu, duşakabinli</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Kullanışlı lüx bir dairedir</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span><b><font face=\"arial black, sans-serif\">Farklı cephe ve katlarda 2+1 3+1 dairelerimiz vardır</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span style=\"color: red;\"><b><font face=\"arial black, sans-serif\">Erdal koruk</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span style=\"color: red;\"><b><font face=\"arial black, sans-serif\">Gayrimenkul yatırım danışmanı</font></b></span></p><p style=\"color: rgb(0, 0, 0);\"><span style=\"color: red;\"><b><font face=\"arial black, sans-serif\">0533 453 83 43</font></b></span></p>', '41.053543742909845,28.855483531951904', 'harmonypark-039-ta-site-ici-satilik-2-1-sifir-ebeveyn-banyolu-daire', '1');
INSERT INTO `ilanlar` VALUES ('3145', 'HARMONY PARK&#039;TA GÜVENLİKLİ OTOPARKLI SİTE İÇİ KİRALIK 2+1 DAİRE', '1.400 TL', 'İstanbul', 'Bağcılar', 'Kemalpaşa Mah.', 'Erdal Koruk', '<p>AKEL EMLAK&apos;TAN </p><p>HARMONY PARK KEMALPAŞA EVLERİNDE KİRALIK 2+1 DAİRE</p><p>ANKASTRE MUTFAK</p><p>EBEVEYN BANYOSU</p><p>BALKON</p><p>GİRİŞTE PORTMANTO</p><p>ISI YAKITIM</p><p>SES YALITIM</p><p>7/24 GÜVENLİK </p><p>AÇIK YÜZME HAVUZU</p><p>HER BLOKTA ÇİFT ASANSÖR</p><p>KAPALI AÇIK OTOPARK</p><p>FUTBOL SAHASI </p><p>BASKETBOL SAHASI</p><p>ÇOCUK OYUN ALANI</p><p>DİNLENME ALANLARI KAMELYALAR</p><p>SİTE KONUMU İTİBARİ İLE TEM BAĞLANTI YOLUNA 1 DK</p><p>BAĞCILAR MERKEZE 5 DK</p><p>TOPLU TAŞIMA ARAÇLARINA 2 DK YÜRÜME MESAFESİNDE DİR</p><p>İKİ KİRA DEPOZİT BİR KİRA PEŞİNAT VE YILLIK KİRANIN %12 HİZMET BEDELİ VARDIR</p><p>DETAYLAR İÇİN </p><p>ERDAL KORUK</p><p>0533 453 83 43</p><p><br /></p><p><br /></p>', '41.05382868219617,28.85435700416565', 'harmony-park-039-ta-guvenlikli-otoparkli-site-ici-kiralik-2-1-daire', '1');
INSERT INTO `ilanlar` VALUES ('3146', 'GÜNEŞLİ EVREN MAH UYGUN FİYATA SATILIK 3+1 BAHÇE KATI', '135.000 TL', 'İstanbul', 'Bağcılar', 'Evren Mah.', 'Erdal Koruk', '<p>AKEL EMLAK&apos;TAN </p><p>UYGUN FİYATA SATILIK 3+1 BAHÇE KATI DAİRE</p><p>DAİRENİN İÇİNDE KİRACI VARDIR KİRA GETİRİSİ 700 TL DİR.</p><p>DAİREMİZ LOKASYONU İTİBARİ İLE İSTENİLİRSE İŞYERİNE ÇEVRİLE BİLİR OZAMAN KİRA GETİRİSİ DAHA FAZLA OLUR</p><p>KREDİYE UYGUN DEĞİLDİR ARSA TAPULUDUR ARSA PAYI % 20 DİR</p><p>GÖRÜLMEYE DEĞER </p><p>ERDAL KORUK 0533 453 83 43</p>', '41.04102820448141,28.819059133529663', 'gunesli-evren-mah-uygun-fiyata-satilik-3-1-bahce-kati', '1');
INSERT INTO `ilanlar` VALUES ('3147', 'GÖKSU LİFE GÜNEŞLİ MEYDAN&#039;DA SATILIK 2+1 118 M2 LÜKS DAİRE', '540.000 TL', 'İstanbul', 'Bağcılar', 'Hürriyet Mah.', 'Erdal Koruk', '<p style=\"color: rgb(85, 85, 85);\"><b>İyi Bir Başlangıç Hayatınızın Teminatıdır...<br />Bağcılar Güneşli Meydan&apos;da, ulaşımı çok rahat bir konumda olan GöksuLife, 2 blok 92 daireden oluşmaktadır. kazançlı bir yatırım için sizleri bekliyor olacak.</b></p><p style=\"color: rgb(85, 85, 85);\"><b>Hayallerinizi ve isteklerinizi geçmişte bırakarak, onları bugüne taşımanın kolaylığını yaşayın. sizlere hayal ettiğiniz yaşamın sözünü veriyoruz. Ailenizle gerçek yuva sıcaklığını hissedeceğiniz, gelecek ve güven kaygısı duymadan yaşayabileceğiniz bir yaşam alanına merhaba diyorsunuz.<br /><br />Geçmişten, geleceğe taşıdığınız, maddi ve manevi her şey için sizlere yeni bir başlangıç fırsatı sunuyoruz.</b></p><p style=\"color: rgb(85, 85, 85);\"><b>Güneşli merkezde GöksuLife konutlarında ulaşımı, konforu, kalitesi, estetiği ve sağlam altyapısıyla size konuttan beklediğinizin fazlasını yaşatacak.</b></p><p style=\"color: rgb(85, 85, 85);\"><b>dairenin özellikleri</b></p><p style=\"color: rgb(85, 85, 85);\"><b>2+1 118 m2 ebeveyn banyolu</b></p><p style=\"color: rgb(85, 85, 85);\"><b>mutfak full ankastre </b></p><p style=\"color: rgb(85, 85, 85);\"><b>ısı yalıtım ses yalıtım</b></p><p style=\"color: rgb(85, 85, 85);\"><b>türk hamamı</b></p><p style=\"color: rgb(85, 85, 85);\"><b>spor salonu</b></p><p style=\"color: rgb(85, 85, 85);\"><b>kapalı otopark </b></p><p style=\"color: rgb(85, 85, 85);\"><b>asansör</b></p><p style=\"color: rgb(85, 85, 85);\"><b>daha bir çok özellik göksu life&apos;da sizleri bekliyor</b></p>', '41.0308848444191,28.830276131629944', 'goksu-life-gunesli-meydan-039-da-satilik-2-1-118-m2-luks-daire', '1');
INSERT INTO `ilanlar` VALUES ('3148', 'YENİ BİNADA SATILIK 5+1 YÜKSEK TAVANLI ÇOK KULLANIŞLI DUBLEKS', '470.000 TL', 'İstanbul', 'Bağcılar', 'Evren Mah.', 'Erdal Koruk', '<p style=\"text-align: center;\"><font face=\"arial black, sans-serif\" size=\"6\" style=\"background-color: rgb(255, 0, 0);\">AKEL EMLAK&apos;TAN</font></p><p>EVREN MAHALLESİNDE ERDEM HASTANESİ KARŞISI FEVZİ ÇAKMAK CADDESİNE 2 PARSEL</p><p>YENİ BİNADA FULL ANKASTRE MUTFAK </p><p>ASANSÖR</p><p>YÜSEK TAVAN GENİŞ TERAS</p><p>ÇOK KULLANIŞLI</p><p>YATAK ODASINDA EBEVEYN BANYOSU</p><p>ÜST KATTA AYRI BANYO MUTFAK</p><p>KÖŞE BAŞI ÜÇ CEPHESİ AÇIK HARİKA MANZARAYA SAHİP</p><p>DAİREMİZİ GÖRMEDEN KARAR VERMEYİN</p><p>DETAYLI BİLGİ İÇİN ARAYINIZ</p><p>AKEL EMLAK GAYRİMENKUL YATIRIM DANIŞMANI</p><p><span>ERDAL KORUK 0533 453 83 43</span></p>', '41.03965885299074,28.824799060821533', 'yeni-binada-satilik-5-1-yuksek-tavanli-cok-kullanisli-dubleks', '1');
INSERT INTO `ilanlar` VALUES ('3149', 'KİRAZLI METROSUNA ÇOK YAKIN OTOPARKLI 3+1 SATILIK', '335.000 TL', 'İstanbul', 'Bağcılar', 'Kazımkarabekir Mah.', 'Aynur Küçükel', '<p></p><p style=\"color: rgb(0, 0, 0);background-color: rgb(255, 255, 255);\"><font size=\"4\" face=\"arial black, sans-serif\">* KİRAZLI METROSUNA ÇOK YAKIN KONUMLU BİRKAÇ DK YÜRÜME MESAFESİNDE</font></p><p style=\"color: rgb(0, 0, 0);background-color: rgb(255, 255, 255);\"><font size=\"4\" face=\"arial black, sans-serif\">* İKİ BLOKLU BİNADA KAPALI KULLANIŞLI KAPALI OTOPARK</font></p><p style=\"color: rgb(0, 0, 0);background-color: rgb(255, 255, 255);\"><font size=\"4\" face=\"arial black, sans-serif\">* KÖŞE BAŞI BİNADA </font></p><p style=\"color: rgb(0, 0, 0);background-color: rgb(255, 255, 255);\"><font size=\"4\" face=\"arial black, sans-serif\">* 1050 M2 ARSA İÇİNDE</font></p><p style=\"color: rgb(0, 0, 0);background-color: rgb(255, 255, 255);\"><font size=\"4\" face=\"arial black, sans-serif\">* 3 KATTA </font></p><p style=\"color: rgb(0, 0, 0);background-color: rgb(255, 255, 255);\"><font size=\"4\" face=\"arial black, sans-serif\">* YENİ BİNADA </font></p><p style=\"color: rgb(0, 0, 0);background-color: rgb(255, 255, 255);\"><font size=\"4\" face=\"arial black, sans-serif\">* KULLANIŞLI AYDINLIK 3+1 DAİREMİZ SATILIKTIR.</font></p><p></p>', '41.03157593786068,28.84588122367859', 'kirazli-metrosuna-cok-yakin-otoparkli-3-1-satilik', '1');
INSERT INTO `ilanlar` VALUES ('3150', '&gt;EVREN MAH 5 KATLI SATILIK SIFIR BİNA İSKANLI HİÇ KULLANILMADI&lt;', '€ 750.000', 'İstanbul', 'Bağcılar', 'Evren Mah.', 'Erdal Koruk', '<p>AKEL EMLAK&apos;TAN KAÇMAZ FIRSAT</p><p>BİNA SIFIR HİÇ KULLANILMADI 5 KAT TOPLAM M2 Sİ 450 M2 DİR</p><p>ASANSÖR BODRUM VE ÇATI KATI DAHİL HER KATA ÇIKMAKTADIR</p><p>HER KATTA AYRI WC LAVABO VARDIR</p><p>ISITMA SİSTEMİ MERKEZİ DOĞAL GAZ KOMBİLİDİR</p><p>LOKASYON OLARAK METRO GROSS MARKETE ÇOK YAKINDIR</p><p>BİNA ÇİFT CEPHE CAM GİYDİRMEDİR</p><p>DETAYLAR İÇİN </p><p>ERDAL KORUK</p><p>0533 453 83 43</p><p><br /></p><p><br /></p>', '41.03357317609825,28.814499378204346', 'gt-evren-mah-5-katli-satilik-sifir-bina-iskanli-hic-kullanilmadi-lt', '1');
