nt></p><p style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><font size=\"5\"><b><br /></b></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><font color=\"#ff0000\"><b><font size=\"5\">çitf sokak cepheli ikiz nizam TİM ARSASIDIR.</font><font size=\"4\">(yıkıp yeniden yapmak isterseniz üstü konut ,zemin dükkan veya komple iş merkezi yapabilirsiniz.)</font></b></font></p><p style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><br /></p><p style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><b>Daha detaylı bilgi için arayız</b><br /></p><p style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><b>0532 413 28 71 Aynur Küçükel</b><br /></p><p style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><font color=\"#ff0000\" size=\"5\"><span><b><strong style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><strong><font size=\"5\"><font color=\"#fff0f5\"><span style=\"background-color: rgb(255, 0, 0);\">                                             AKEL EMLAK </span></font><font color=\"#ff0000\"><span style=\"background-color: rgb(255, 0, 0);\">tan nmnmnmnmnmmmnmnmnmn</span></font></font></strong></strong><strong style=\"color: rgb(0, 0, 0);text-align: center;background-color: rgb(255, 255, 255);\"><strong><font size=\"5\"><font color=\"#ff0000\"> </font></font></strong></strong></b></span></font></p>', '41.04193451489662,28.83184790611267', 'gunesli-de-mahmutbey-c-2-parsel-3300-m2-net-satilik-bina-amp-is-hani', '1');
