INSERT INTO `ilanlar` VALUES ('3161', '++++ AKEL den ÇINAR OLİMPİA PEYZAJ MANZARALI 3+1 SATILIK DAİRE', '530.000 TL', 'İstanbul', 'Bağcılar', 'Fevziçakmak Mah.', 'Aynur Küçükel', '<p style=\"text-align: center;\"><strong><font size=\"5\"><font color=\"#fff0f5\"><span style=\"background-color: rgb(255, 0, 0);\">AKEL EMLAK</span> </font><font color=\"#ff0000\">tan SATILIK daire</font></font></strong></p><p style=\"text-align: center;\"><b style=\"color: rgb(255, 0, 0);\"> PEYZAJ MANZARALI 3+1 DAİRE</b></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>BAĞCILAR İlçesinin merkezinde bulunan ÇINAR olimpia park sitesi</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>Metar grup güvencesi ile imal edilmiş,mimarisi ile de göz dolduran prestijli bir projedir.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>Ulaşım kolaylığı ile de tercih edilen komple bir projesidir.</strong></span></p><p style=\"text-align: center;\"><strong><font color=\"#ff0000\">Dairenin tanıtımı : </font></strong></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Detaylı bilgiler kısmındaki iç ve dış özelliklerin tümü eksiksiz mevcuttur.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Mutfakta kiler odası mevcuttur.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Isı izolasyonu teknik şartnameye uygun yapıldığı için kış mevsiminde ısı kaybı minimalize edilmiştir.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Sosyal tesisleri hijyenik olup,sadece bayanlar için ayrılmış günleri vardır.Açık havuzu mevcuttur.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Otopark sıkıntısı yoktur,açık kapalı otoparklıdır.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Ayrıca yük asansörü olup,haricinde 2 asansör daha mevcuttur.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Müstakil jeneratör elektirik kesintilerinde otomatik devreye girmektedir.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*ÖZENLİ bir site yönetimine ve titiz bir güvenliğe sahiptir.</strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"> </p><p style=\"color: rgb(0, 0, 0);text-align: center;\"> </p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span><strong>*Detaylı bilgi ve dairemizi görmek için <span style=\"color: rgb(255, 0, 0);\"><span>AKEL EMLAK </span> Aynur Küçükel</span></strong></span></p><p style=\"color: rgb(0, 0, 0);text-align: center;\"><span style=\"color: rgb(255, 0, 0);\"><span><strong>                                                                            0532 413 28 71</strong></span></span></p>', '41.04352330965054,28.852200508117676', 'akel-den-cinar-olimpia-peyzaj-manzarali-3-1-satilik-daire', '1');
INSERT INTO `ilanlar` VALUES ('3162', 'GÜNEŞLİDE SATILIK 2+1 OTOPARKLI EBEVEYN BANYOLU OTOPARKLI', '360.000 TL', 'İstanbul', 'Bağcılar', 'Hürriyet Mah.', 'Erdal Koruk', '<p>AKEL EMLAK&apos;TAN</p><p>YENİ BİNADA KREDİYE UYGUN İSKANLI</p><p>DAİREMİZ GÜNEŞLİNİN EN GÜZEL YERİNDEDİR TEK BLOKLU SİTE İÇİNDE</p><p>AÇIK OTOPARK ALANI</p><p>İKİ ADET ASANSÖR</p><p>ÇOCUK OYUN PARKI </p><p>KAMELYA DİNLENME ALANI </p><p>DETAYLAR İÇİN ARAYINIZ</p><p>ERDAL KORUK 0533 453 83 43</p>', '41.02961733616753,28.829680681228638', 'guneslide-satilik-2-1-otoparkli-ebeveyn-banyolu-otoparkli', '1');
INSERT INTO `ilanlar` VALUES ('3163', 'KURUMSAL FİRMALARA CADDE CEPHELİ 580 M2 DÜZ GİRİŞ DÜKKAN', '20.000 TL', 'İstanbul', 'Bağcılar', 'Güneşli Mah.', 'Erdal Koruk', '<p>KİRALIK PORTFÖYÜMÜZÜN TANIMI</p><p>TABELA DEĞERİ ÇOKYÜKSEK CADDEYE CEPHEDİR</p><p>DÜZ GİRİŞ 290 M2 TAVAN YÜKSEKLİĞİ H:3.80</p><p>BODRUM 290 M2 TAVAN YÜKSEKLİĞİ H:3.80</p><p>İÇERİSİNDE 2 TONLUK YÜK ASANSÖRÜ </p><p>50 TONLUK SU DEPOSU</p><p>HER KATTA KOMBİ BAY BAYAN LAVABO WC MUTFAK BÖLÜMÜ</p><p>BİNANIN 50 TONLUK SU DEPOSU SANAYİ ELEKTRİĞİ</p><p>ZEMİNLER 1. SINIF SERAMİK KAPLI</p><p>İSKANLI YENİ BİNADA</p><p>İKİ KİRA DEPOZİT </p><p>BİR KİRA PEŞİN İSTENMEKTEDİR</p><p>DETAYLAR İÇİN ARAYINIZ</p><p>ERDAL KORUK 0533 453 83 43</p><p><br /></p>', '41.039768604465124,28.83288860321045', 'kurumsal-firmalara-cadde-cepheli-580-m2-duz-giris-dukkan', '1');
